  `sanctioned_amount` float DEFAULT NULL,
  `foundation_date` date DEFAULT NULL,
  `inaugration_date` date DEFAULT NULL,
  `status` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `remarks` longtext,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `entity_status_id` bigint(20) DEFAULT NULL,
  `valid_type_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_development_works_on_department_id` (`department_id`),
  KEY `index_development_works_on_place_id` (`place_id`),
  KEY `index_development_works_on_entity_status_id` (`entity_status_id`),
  CONSTRAINT `fk_rails_52907e5212` FOREIGN KEY (`department_id`) REFERENCES `departments` (`id`),
  CONSTRAINT `fk_rails_89773b51cd` FOREIGN KEY (`entity_status_id`) REFERENCES `entity_statuses` (`id`),
  CONSTRAINT `fk_rails_adcc8a5b3b` FOREIGN KEY (`place_id`) REFERENCES `places` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=439 DEFAULT CHARSET=utf8;
