9-06-02 14:27:38'),(93,'COMMITTE MEETING AT VIDHANASOUDHA','','2019-06-04','18:30:00','18:29:00','ಬೆಂಗಳೂರು','','2019-06-03 09:39:29','2019-06-03 09:39:29'),(94,'CONSTITUENCY WORK IN BANGALORE','','2019-06-05','18:30:00','18:29:00','ಬೆಂಗಳೂರು','','2019-06-03 09:40:40','2019-06-03 09:40:40'),(95,'VISHWA PARISARA DINAACHARANE','ಅರಣ್ಯ ಇಲಾಖೆಯ ಕಛೇರಿ ಎದುರು ಜಾಥಾಕ್ಕೆ ಚಾಲನೆಯನ್ನು ನೀಡಿ ವಿದ್ಯಾಂಜಲಿ ಶಾಲೆಯ ಆವರಣದಲ್ಲಿ ವನಮಹೋತ್ಸವ  ಆಚರಣೆ','2019-06-06','04:30:00','06:30:00','ಅರಣ್ಯ ಇಲಾಖೆ ಭಟ್ಕಳ, ','','2019-06-05 14:34:54','2019-06-07 04:35:55'),(96,'PRIVATE FUNCTION','','2019-06-06','19:30:00','13:30:00','ಖಾಸಗಿ ಕಾರ್ಯಕ್ರಮ','','2019-06-05 14:36:04','2019-06-05 14:36:04'),(97,'VISHWA PARISARA DINAACHARANE','ವಲಯ ಅರಣ್ಯಾಧಿಕಾರಿಗಳ ಕಚೇರಿಯ ಎದುರು  ವಿಶ್ವ ಪರಿಸರ ದಿನಾಚರಣೆಯ ಜಾಥಾ ಚಾಲನೆಯನ್ನು ನೀಡಿ ಕಾಸರಕೋಡು  ಇಕೋ ಬೀಚ್‌ ಸ್ವಚ್ಛಗೊಳಿಸುವ ಕಾಯಕ್ರಮದಲ್ಲಿ ಭಾಗವಹಿಸಿ ವನಮಹೋತ್ಸವ ಕಾರ್ಯಕ್ರಮಕ್ಕೆ ಚಾಲನೆಯನ್ನು ನೀಡಿ ಸಭಾಕಾರ್ಯಕ್ರಮದಲ್ಲಿ ಭಾಗವಹಿಸುವರು','2019-06-07','03:30:00','07:00:00','ಅರಣ್ಯ ಇಲಾಖೆ ಹೊನ್ನಾವರ ','ಪರಿಸರ ನಾಶದಿಂದ ಆಗುವಂತಹ ದುಷ್ಪರಿಣಾಮವನ್ನು ಈಗಾಗಲೆ ನಮ್ಮ ಜಿಲ್ಲೆ ಅನುಭವಿಸುತ್ತಿದೆ. ಪರಿಸರ ನಾಶದಿಂದಾಗಿ ಎಲ್ಲೆಡೆ ಬರಗಾಲ ಆವರಿಸಿ ಕುಡಿಯುವ ನೀರಿಗಾಗಿ ಹುಡುಕಾಟ ನಡೆಸುವ ಪರಿಸ್ಥಿತಿ ಬಂದೊದಗಿದೆ.\r\n\r\nನಮ್ಮ ಜಿಲ್ಲೆಗೆ ಕರ್ನಾಟಕದ ಕಾಶ್ಮೀರ ಎಂಬ ಹೆಗ್ಗಳಿಕೆ ಇದೆ.\r\nಆದರೆ ಪರಿಸರ ನಾಶದಿಂದ ಇಂದು ಇದೇ ಜಿಲ್ಲೆಯಲ್ಲಿ ನೀರಿಗಾಗಿ ಹಾಹಾಕಾರ ಉಂಟಾಗಿದೆ. ಇದಕ್ಕೆಲ್ಲಾ ಕಾರಣ ನಾವೇ. ಕೇವಲ ಪರಿಸರ ದಿನಾಚರಣೆಯ ದಿನದಂದು ಎರಡು ಗಿಡಗಳನ್ನು ನೆಟ್ಟು ಮಿಕ್ಕ ದಿನಗಳಲ್ಲಿ ಮನೆ, ಅಂಗಡಿ ಮುಂಗಟ್ಟುಗಳನ್ನು ಕಟ್ಟುವ ಸಲುವಾಗಿ ಮರಗಳನ್ನು ಕಡಿಯುತ್ತಾ ಬಂದಿದ್ದೇವೆ.\r\n\r\nಇನ್ನು ಮುಂದಿನ ದಿನಗಳಲ್ಲಿ ಇದು ಸಲ್ಲದು. ಪರಿಸರ ನಾಶ ಹೀಗೆ ಮುಂದುವರಿದರೆ ಅದರ ಭೀಕರತೆಯನ್ನು ನಾವು ಮತ್ತು ನಮ್ಮ ಮುಂದಿನ ಪೀಳಿಗೆಗಳು ಅನುಭವಿಸಬೇಕಾಗುತ್ತದೆ. ಈ ಭೂಮಿ ಕೇವಲ ಮನುಷ್ಯನಿಗೆ ಮಾತ್ರ ಸೀಮಿತವಲ್ಲ, ಇಲ್ಲಿ ಪ್ರಾಣಿ ಪಕ್ಷಿಗಳಿಗೂ ಬದುಕುವ ಹಕ್ಕಿದೆ. ಪರಿಸರ ನಾಶದಿಂದ ಪ್ರಾಣಿ ಪಕ್ಷಿಗಳು ಸಾವಿಗೀಡಾಗುತ್ತಿವೆ. \r\n\r\nಇನ್ನಾದರೂ ಎಚ್ಚೆತ್ತುಕೊಂಡು ಪರಿಸರವನ್ನು ಕಾಪಾಡಿಕೊಳ್ಳೋಣ. ಪ್ರಾಣಿ ಪಕ್ಷಿಗಳೊಂದಿಗೆ ನಮ್ಮ ಮುಂದಿನ ಪೀಳಿಗೆಗಾಗಿ ಪರಿಸರವನ್ನು ಉಳಿಸಿಕೊಳ್ಳೋಣ. ಪರಿಸರ ಸಂರಕ್ಷಣೆ ಕೆವಲ ಪರಿಸರ ದಿನಾಚರಣೆಯ ದಿನಕ್ಕೆ ಸೀಮಿತವಾಗಬಾರದು. ನಮ್ಮ ಸುತ್ತ ಮುತ್ತಲಿನ ಪ್ರದೇಶದಲ್ಲಿ ಪ್ರತಿಯೊಬ್ಬರೂ ಒಂದೂಂದು ಸಸಿಗಳನ್ನು ನೆಟ್ಟು ಅದನ್ನು ಪೋಷಿಸುವ ಮೂಲಕ ನೀರು, ಗಾಳಿ ಉತ್ತಮ ವಾತಾವರಣವನ್ನು ಸೃಷ್ಟಿಸೋಣ. \r\n\r\nಇಂದು ಕರ್ನಾಟಕ ಅರಣ್ಯ ಇಲಾಖೆ, ಹೊನ್ನಾವರ ಅರಣ್ಯ ವಿಭಾಗ, ಹೊನ್ನಾವರ ಉಪವಿಭಾಗ, ಹೊನ್ನಾವರ ವಲಯ ಇವರ ವತಿಯಿಂದ ವಿಶ್ವ ಪರಿಸರ ದಿನಾಚರಣೆ 2019 ಕಾರ್ಯಕ್ರಮವನ್ನು ಉದ್ಘಾಟಿಸಲಾಯಿತು.\r\n\r\n\r\n    ','2019-06-06 11:24:43','2019-06-07 07:31:27'),(98,'MUKHYA MANTRI PARIHARA NIDHI CHEQUE DISTRIBUTION','','2019-06-07','09:30:00','10:00:00','ತಾಲೂಕು ಪಂಚಾಯತ ಭಟ್ಕಳ, ಶಾಸಕರ ಕಚೇರಿ','','2019-06-06 11:27:23','2019-06-06 11:27:23'),(99,'BHAGYALAXMI BOND DISTRIBUTION','ಹೆಣ್ಣು ಮಗುವಿನ ಸ್ಥಾನವನ್ನು ಮೊದಲು ಕುಟುಂಬದಲ್ಲಿ ನಂತರ ಸಮಾಜದಲ್ಲಿ ಹೆಚ್ಚಿಸಲು ಮತ್ತು ಬಡತನದ ರೇಖೆಗಿಂತ ಕೆಳಗಿರುವ ಕುಟುಂಬಗಳಲ್ಲಿ ಹೆಣ್ಣು ಮಗುವಿನ ಜನನ ಉತ್ತೇಜಿಸಲು ನಮ್ಮ ನೆಚ್ಚಿನ ನಾಯಕರಾದ ಶ್ರೀ ಬಿ.ಎಸ್.ಯಡೀಯೂರಪ್ಪನವರು ತಮ್ಮ ಅಧಿಕಾರಾವಧಿಯಲ್ಲಿ ಪ್ರಾರಂಭಿಸಿದ ಭಾಗ್ಯಲಕ್ಷ್ಮೀ ಬಾಂಡ ವಿತರಣೆ ನಡೆಸಲಾಗುವುದು.','2019-06-07','10:15:00','12:30:00','ವೆಂಕಟೇಶ್ವರ ಸಭಾಭವನ ,ಆಸರಕೇರಿ,ಭಟ್ಕಳ','ಸಮಾಜದಲ್ಲಿ ತಲತಲಾಂತರದಿಂದ ರೂಡಿಯಲ್ಲಿರುವ ಮೂಡನಂಬಿಕೆಗಳಲ್ಲಿ ಹೆಚ್ಚಿನವು ಒಳಗೊಳ್ಳುವುದು ಮಹಿಳೆಯನ್ನು. ಸಂಪ್ರದಾಯ ಮತ್ತು ನಂಬಿಕೆಗಳನ್ನು ಹುಟ್ಟುಹಾಕುವುದು ಪ್ರಮುಖವಾಗಿ ಸಮಾಜದ ಪುರುಷ ಪ್ರದಾನ ಪ್ರವೃತ್ತಿ. ಇದರಿಂದ  ಹುಟ್ಟಿದ ಮೂಡನಂಬಿಕೆಗಳಿಗೆ ಹೆಣ್ಣೆ ಮುಖ್ಯವಾಗಿ ಗುರಿಯಾಗುತ್ತಾಳೆ\r\n\r\nಮಾನವ ಜನ್ಮದಲ್ಲಿಯೇ ಹೆಣ್ಣಿನ ಜನ್ಮ ಶ್ರೇಷ್ಠವಾದಂತಹ ಜನ್ಮ. ಹೆಣ್ಣು ಮಗು ಹುಟ್ಟಿದರೆ ಅದು ಶಾಪವಲ್ಲ, ಬದಲಾಗಿ ವರ ಎಂದು ಖಚಿತಪಡಿಸಲು ಸನ್ಮಾನ್ಯ ಮಾಜಿ ಮುಖ್ಯಮಂತ್ರಿಗಳಾದ ಯಡಿಯೂರಪ್ಪನವರ ಆಗಿನ ಸರ್ಕಾರ 2006-07 ರಲ್ಲಿ ಭಾಗ್ಯಲಕ್ಷ್ಮಿ ಯೋಜನೆ ಜಾರಿಗೆ ತಂದಿದ್ದರು. \r\n\r\nಬಡತನ ರೇಖೆಗಿಂತ ಕೆಳಗಿನ ಕುಟುಂಬದಲ್ಲಿ ಜನಿಸಿದ ಎರಡು ಹೆಣ್ಣು ಮಕ್ಕಳಿಗೆ ಯೋಜನೆಯ ಲಾಭ ದೊರೆಯಲಿದೆ. ಹೆಣ್ಣು ಮಕ್ಕಳಿಗೆ ಶಿಕ್ಷಣ ಕೊಡಿಸುವಲ್ಲಿ ಪೋಷಕರು ಹಿಂದೇಟು ಹಾಕಬಾರದು. ಹೆಣ್ಣೊಂದು ಕಲಿತರೆ ಶಾಲೆಯೊಂದು ತೆರೆದಂತೆ ಎಂಬ ನಾಣ್ನುಡಿಯನ್ನು ನಿಜ ಮಾಡಬೇಕು. ಮಹಿಳಾಪರ ಕಾಳಜಿ ಇರುವ ಈ ಯೋಜನೆ ನಿರಂತರವಾಗಿ ಮುಂದುವರಿಯಲಿದೆ.\r\n\r\nಈ ನಿಟ್ಟಿನಲ್ಲಿ ಕಳೆದ ಕೆಲವು ವರ್ಷಗಳಿಂದ ಬಾಕಿ ಉಳಿದಿದ್ದ, ಭಟ್ಕಳ ತಾಲ್ಲೂಕಿನ ಸರಿ ಸುಮಾರು 350 ಭಾಗ್ಯಲಕ್ಷ್ಮಿ ಯೋಜನೆಯನ್ನು ಬಾಂಡ್ ನ್ನು ಇಂದು ಫಲಾನುಭವಿಗಳಿಗೆ ವಿತರಿಸಲಾಯಿತು.','2019-06-06 11:33:50','2019-06-07 12:04:46'),(100,'PRIVATE FUNCTION','','2019-06-07','12:30:00','14:30:00','ಖಾಸಗಿ ಕಾರ್ಯಕ್ರಮ','','2019-06-06 11:35:14','2019-06-06 11:35:14'),(101,'MINOR IRRIGATION WORK INSPECTION AT BELKE DUBARIMANE','','2019-06-08','05:00:00','07:00:00','ಬೆಳ್ಕೆ ಪಂಚಾಯತ ದುಬಾರಿಮನೆ','ಭಟ್ಕಳ ತಾಲ್ಲೂಕಿನ ಬೆಳ್ಕೆ ಪಂಚಾಯತ್ ವ್ಯಾಪ್ತಿಯ ದುಬಾರಿಮನೆ ಹೊಳೆಗೆ ಅಂದಾಜು ಮೊತ