ಮಗಾರಿಯನ್ನು ಪರೀಕ್ಷಿಸಲಾಯಿತು. ಈ ಕಾಮಗಾರಿಯಿಂದ ಸುತ್ತ ಮುತ್ತಲಿನ ರೈತರಿಗೆ ಅನುಕೂಲವಾಗಲಿದೆ.','2019-06-08 12:50:58','2019-06-08 12:54:53'),(108,'ENGLISH MEDIUM DIVISION INAUGRATION','','2019-06-10','03:30:00','04:00:00','ಸರಕಾರಿ ಹಿರಿಯ ಪ್ರಾಥಮಿಕ ಶಾಲೆ ಕಾಯ್ಕಿಣಿ','ಸರಕಾರಿ ಹಿರಿಯ ಪ್ರಾಥಮಿಕ ಶಾಲೆ ಕಾಯ್ಕಿಣಿಯ ಆಂಗ್ಲ ಮಾಧ್ಯಮ ತರಗತಿ ಪ್ರಾರಂಭೊತ್ಸವವನ್ನು ಮಾನ್ಶ ಶಾಸಕರು ಉದ್ಘಾಟಿಸುವುದರ ಮೂಲಕ ಗ್ರಾಮೀಣ ಭಾಗದ ಶಾಲಾ ಮಕ್ಕಳಿಗೆ ಆಂಗ್ಲ ಮಾದ್ಯಮದಲ್ಲಿ  ಭೋದಿಸುವ  ಮಹತ್ತರವಾದ ಯೋಜನೆಗೆ ಚಾಲನೆ ನೀಡಲಾಯಿತು.','2019-06-09 11:20:33','2019-06-10 07:41:30'),(109,'KRISHI ABHIYANA AND INFORMATION CHARIOT INAUGRATION','','2019-06-10','04:30:00','04:45:00','ತಾಲೂಕು ಪಂಚಾಯತ ಆವರಣ,ಭಟ್ಕಳ','ಭಟ್ಕಳ ಕೃಷಿ ಇಲಾಖೆ ವತಿಯಿಂದ ತಾಲ್ಲೂಕು ಪಂಚಾಯಿತಿ ಭಟ್ಕಳ ಆವರಣದಲ್ಲಿ ನಡೆದ ಕೃಷಿ ಅಭಿಯಾನಕ್ಕೆ ಚಾಲನೆ ನೀಡಿ, ಮಾಹಿತಿ ರಥವನ್ನು ಉದ್ಘಾಟಿಸಲಾಯಿತು.','2019-06-09 11:28:15','2019-06-10 07:38:32'),(110,'ENGLISH MEDIUM DIVISION INNAGURATION ','','2019-06-10','05:15:00','05:45:00','ಸರಕಾರಿ ಹಿರಿಯ ಪ್ರಾಥಮಿಕ ಶಾಲೆ ಗುಳದಕೇರಿ, ಮಂಕಿ','','2019-06-09 11:31:34','2019-06-10 07:50:43'),(111,'ENGLISH MEDIUM DIVISION INNAGURATION AT H.P.S.CHITTAR','','2019-06-10','05:50:00','06:15:00','ಸರಕಾರಿ ಹಿರಿಯ ಪ್ರಾಥಮಿಕ ಶಾಲೆ,ಚಿತ್ತಾರ,ಮಂಕಿ','','2019-06-09 11:34:42','2019-06-10 07:51:51'),(112,'JANASPANDANA','','2019-06-10','06:30:00','08:30:00','ಶಾಸಕರ ಕಚೇರಿ, ಹೊನ್ನಾವರ','','2019-06-09 11:35:58','2019-06-09 11:36:50'),(113,'PRIVATE FUNCTION','','2019-06-10','08:35:00','13:30:00','ಖಾಸಗಿ ಕಾರ್ಯಕ್ರಮ','','2019-06-09 11:38:02','2019-06-09 11:42:03'),(114,'COMMITTEE MEETING ','','2019-06-11','18:30:00','18:29:00','ಬೆಂಗಳೂರು ','ಉತ್ತರ ಕನ್ನಡ ಜಿಲ್ಲೆಯಲ್ಲಿ ಮಲ್ಟಿ ಸ್ಪೇಷಾಲಿಟಿ ಆಸ್ಪತ್ರೆ ನಿರ್ಮಾಣಕ್ಕಾಗಿ ಹಲವು ದಿನಗಳಿಂದ ಸಾಮಾಜಿಕ ಜಾಲತಾಣಗಳಲ್ಲಿ ಅಭಿಯಾನ ಶುರುವಾಗಿದ್ದು ಈಗಾಗಲೆ ಮುಖ್ಯಮಂತ್ರಿಗಳಿಗೆ ಮನವಿ ಮಾಡಲಾಗಿತ್ತು. ಈ ಸಂಬಂಧ ಇಂದು ಬೆಂಗಳೂರಿನಲ್ಲಿ ಸನ್ಮಾನ್ಯ ಮುಖ್ಯಮಂತ್ರಿಗಳಾದ ಕುಮಾರಸ್ವಾಮಿಯವರನ್ನು ಭೆಟಿಯಾಗಿ ಉತ್ತರ ಕನ್ನಡ ಜಿಲ್ಲೆಗೆ ಮಲ್ಟಿ ಸ್ಪೇಷಾಲಿಟಿ ಆಸ್ಪತ್ರೆ ಅವಶ್ಯಕತೆಯನ್ನು ಮನವರಿಕೆ ಮಾಡಿ ಶೀಘ್ರದಲ್ಲಿ ಆಸ್ಪತ್ರೆ ನಿರ್ಮಾಣಕ್ಕಾಗಿ ಅಗತ್ಯ ಕ್ರಮಗಳನ್ನು ಕೈಗೊಳ್ಳುವಂತೆ ಕೋರಿಕೊಳ್ಳಲಾಯಿತು.\r\n\r\nಉತ್ತರ ಕನ್ನಡ ಜನತೆಯ ಪಕ್ಷಾತೀತವಾದ ಹೋರಾಟಕ್ಕೆ ಬೆಂಬಲವಾಗಿ ನನ್ನಿಂದಾಗುವ ಎಲ್ಲಾ ಪ್ರಾಮಾಣಿಕ ಪ್ರಯತ್ನ ಮಾಡುವುದಾಗಿ ಈ ಮೂಲಕ ತಿಳಿಸಲು ಇಚ್ಛಿಸುತ್ತೇನೆ. \r\n','2019-06-11 15:40:38','2019-06-12 07:07:04'),(115,'CONSTITUENCY WORK','','2019-06-12','18:30:00','18:29:00','ಬೆಂಗಳೂರು ','','2019-06-11 15:43:14','2019-06-11 15:43:14'),(116,'RETURNING FROM BANGALORE','','2019-06-13','18:30:00','12:30:00','ಬೆಂಗಳೂರು ','','2019-06-12 16:44:16','2019-06-12 16:44:16'),(117,'JANASPANDANA','','2019-06-14','04:30:00','06:30:00','ಶಾಸಕರ ಗೃಹ ಕಚೇರಿ,ಶಿರಾಲಿ','','2019-06-13 14:05:09','2019-06-13 14:05:09'),(118,'PRIVATE FUNCTION','','2019-06-14','06:40:00','15:30:00','ಖಾಸಗಿ ಕಾರ್ಯಕ್ರಮ','','2019-06-13 14:06:23','2019-06-13 14:06:23'),(119,'DISTRICT KDP MEETING AT KARWAR','','2019-06-15','00:30:00','14:30:00','ಜಿಲ್ಲಾಪಂಚಾಯತ ಸಭಾಭವನ ,ಕಾರವಾರ','ಇಂದು ಕಾರವಾರದಲ್ಲಿ, ಜಿಲ್ಲಾ ಉಸ್ತುವಾರಿ ಸಚಿವರ ನೇತೃತ್ವದಲ್ಲಿ ನಡೆದ ಕೆಡಿಪಿ ಸಭೆಯಲ್ಲಿ ಭಾಗವಹಿಸಿ ಮುಖ್ಯವಾಗಿ ಈ ಕೆಳಗಿನ ವಿಷಯಗಳ ಬಗ್ಗೆ ಚರ್ಚೆ ನಡೆಸಲಾಯಿತು. \r\n\r\n *ಆಯುಷ್ಮಾನ್  ಭಾರತ  ಆರೋಗ್ಯ ಕರ್ನಾಟಕ ಯೋಜನೆಯ* ಗೊಂದಲಗಳ ಬಗ್ಗೆ ಮತ್ತು ಇದರ ಕುರಿತು ಸಂಪೂರ್ಣವಾದ ಮಾಹಿತಿ ಗ್ರಾಮೀಣ ಭಾಗಕ್ಕೆ ಇದುವರೆಗೂ ತಲುಪದಿರುವ ಬಗ್ಗೆ ಚರ್ಚಿಸಿ ಶೀಘ್ರವೇ ಸಮಸ್ಯೆಯನ್ನು ಬಗೆಹರಿಸುವಂತೆ ಒತ್ತಾಯಿಸಲಾಯಿತು.\r\n\r\n  *KPS (ಕರ್ನಾಟಕ ಪಬ್ಲಿಕ್ ಸ್ಕೂಲ್)* ಯೋಜನೆಯಡಿಯಲ್ಲಿ ಈಗಾಗಲೆ ಭಟ್ಕಳ ಹೊನ್ನಾವರ ವಿಧಾನಸಭಾ ಕ್ಷೇತ್ರದಲ್ಲಿ 5 ಶಾಲೆಗಳಲ್ಲಿ ಆಂಗ್ಲ ಮಾಧ್ಯಮ ವಿಭಾಗ ಪ್ರಾರಂಭವಾಗಿದ್ದು, ಸರ್ಕಾರ ಒಂದು ಶಾಲೆಯಲ್ಲಿ ಆಂಗ್ಲ ಮಾಧ್ಯಮ ವಿಭಾಗಕ್ಕೆ ಕೆವಲ 30 ವಿದ್ಯಾರ್ಥಿಗಳಿಗೆ ಮಾತ್ರ ಪ್ರವೇಶಾತಿ ಕಲ್ಪಿಸಿದ್ದು ಉಳಿದವರು ಕನ್ನಡ ಮಾಧ್ಯಮಕ್ಕೆ ದಾಖಲಾಗುತ್ತಿದ್ದರು. ಆದರೆ ಮುಖ್ಯಮಂತ್ರಿಗಳು ಹೆಚ್ಚುವರಿ ವಿಭಾಗಕ್ಕೆ ಅನುಮತಿ ನೀಡುವ ಕುರಿತು ಮಾಧ್ಯಮಗಳ ಮೂಲಕ ಘೋಷಿಸಿದ್ದು, ಇದರಿಂದ ಪಾಲಕರು ಮಕ್ಕಳನ್ನು ಕನ್ನಡ ವಿಭಾಗಕ್ಕೂ ದಾಖಲಿಸದೆ ಕಾಯುತ್ತಿದ್ದಾರೆ. ಈ ಕುರಿತು ಕೂಡಲೆ ಸ್ಪಷ್ಟನೆ ನೀಡಬೇಕೆಂದು ಒತ್ತಾಯಿಸಲಾಯಿತು. \r\n\r\nKPS ಆರಂಭವಾದ ಶಾಲೆಗಳ ಸಮೀಪದ ಅಂಗನವಾಡಿಗಳು ಮಕ್ಕಳ ಕೊರತೆಯಿಂದ ಮುಚ್ಚುವ ಸ್ಥಿತಿಗೆ ಬಂದಿದ್ದು, ಅಲ್ಲಿಯ ಕಟ್ಟಡ, ಮೂಲಭೂತ ಸೌಕರ್ಯಗಳು ಹಾಗೂ *ಅಂಗನವಾಡಿ ಕಾರ್ಯಕರ್ತೆಯರು ಮತ್ತು ಸಹಾಯಕರ ಭದ್ರತೆ* ಏನು ಎಂಬುವುದರ ಬಗ್ಗೆ ಚರ್ಚಿಸಲಾಯಿತು. \r\n\r\nಸರ್ಕಾರದ *ವಸತಿಯೋಜನೆಯಡಿಯಲ್ಲಿ* ನಿರ್ಮಾಣವಾಗುವ ಮನೆಗಳ ಲೋಪದೋಷಕ್ಕೆ ಸಂಬಂಧಿಸಿದಂತೆ ಪ್ರಕರಣಗಳು ಗ್ರಾ. ಪಂ ಮತ್ತು ತಾ. ಪಂ. ಗಳಿಂದ ಸ್ವೀಕ್ರತಿಯಾಗಿ 5 ರೀಂದ 6 ತಿಂಗಳುಗಳು ಕಳೆದರೂ ಜಿ. ಪಂಚಾಯತದ ವಸತಿ ವಿಭಾಗದಲ್ಲಿ ಯಾವುದೇ ಕ್ರಮ ಆಗದಿರುವುದರ ಕುರಿತು ತಕ್ಷಣ ಕ್ರಮವಹಿಸುವಂತೆ ಒತ್ತಾಯಿಸಲಾಯಿತು. \r\n\r\nಉಳಿದಂತೆ ಕ್ಷೇತ್ರದ ಹತ್ತು ಹಲವು ಸಮಸ್ಯೆಗಳ ಬಗ್ಗೆ ಕೆಡಿಪಿ ಸಭೆಯಲ್ಲಿ ಪ್ರಶ್ನಿಸಿ , ಆ ಬಗ್ಗೆ ಚರ್ಚಿಸಿ ಸೂಕ್ತ ಪರಿಹಾರವನ್ನು ಕಂಡುಕೊಳ್ಳಲಾಯಿತು.','2019-06-14 11:45:14','2019-06-15 13:34:01'),(120,'FISH MARKET BUILDING SITE VISIT','','2019-06-14','06:30:00','07:30:00','ಯಲ್ವಡಿಕವೂರು','ಭಟ್ಕಳ ತಾಲ್ಲೂಕಿನ ಯಲ್ವಡಿಕವೂರ್ ಪಂಚಾಯತ್ ವ್ಯಾಪ್ತಿಯ ಸರ್ಪನಕಟ್ಟೆಯಲ್ಲಿ 28 ಲಕ್ಷ ರೂಪಾಯಿ ವೆಚ್ಚದ ನೂತನ ಮೀನು ಮಾರುಕಟ್ಟೆ ಕಟ್ಟಡ ನಿರ್ಮಾಣಕ್ಕೆ ಅನುದಾನ ಮಂಜೂರಾಗಿದ್ದು, ಸ್ಥಳ ಸಮಸ್ಯೆಯಿಂದ ಕಾಮಗಾರಿ ಪ್ರಾರಂಭವಾಗಿರಲಿಲ್ಲ . ಕಾರಣ ಇಂದು ಸಂಬಂಧ ಪಟ್ಟ ಅಧಿಕಾರಿಗಳೊಂದಿಗೆ ಸರ್ಪನಕಟ್ಟೆಗೆ ಭೇಟಿ ನೀಡಿ, ಮಾರುಕಟ್ಟೆಗೆ ಸೂಕ್ತ ಸ್ಥಳವನ್ನು ಗುರುತಿಸಿ ನೂತನ ಕಟ್ಟಡ ನಿರ್ಮಾಣ ಕಾಮಗಾರಿಗೆ ಅನುವುಮಾಡಿಕೊಡಲಾಯಿತು.','2019-06-14 12:56:32','2019-06-14 12:58:00'),(121,'JANASPANDANA','','2019-06-16','06:00:00','07:30:00','ಶಾಸಕರ ಗೃಹ ಕಚೇರಿ ,ಶಿರಾಲಿ','','2019-06-15 11:28:18','2019-06-15 11:29:13'),(122,'BOOKS DISTRIBUTION','ವೆಂಕಟೇಶ್ವರ ವಿದ್ಯಾವರ್ಧಕ ಸಂಘ','2019-06-16','04:30:00','06:00:00','ನಿಚ್ಚಲಮಕ್ಕಿ ವೆಂಕಟೇಶ್ವರ ಸಭಾಭವನ,ಆಸರಕೇರಿ,ಭಟ್ಕಳ','ಭಟ್ಕಳ ನಿಚ್ಚಲಮಕ್ಕಿ ವೆಂಕಟರಮಣ ಸಭಾಭವನದಲ್ಲಿ, ಶ್ರೀ ವೆಂಕಟೇಶ್ವರ ವಿದ್ಯಾವರ್ಧಕದ ಸೇವಾ ಸಂಸ್ಥೆ \r\nಭಟ್ಕಳ (ರಿ) ಇವರ ವತಿಯಿಂದ ನಡೆದ ಪುಸ್ತಕ ವಿತರಣಾ ಕಾರ್ಯಕ್ರಮವನ್ನು ಉದ್ಘಾಟಿಸಿ ವಿದ್ಯಾರ್ಥಿಗಳಿಗೆ ಪುಸ್ತಕಗಳನ್ನು ವಿತರಿಸಲಾಯಿತು.\r\n','2019-06-15 11:34:12','2019-06-16 07:57:16'),(123,'PRIVATE FUNCTION','','2019-06-16','09:30:00','13:30:00','ಖಾಸಗಿ ಕಾರ್ಯಕ್ರಮ','','2019-06-15 11:39:18','2019-06-15 11:39:18'),(124,'JANASPANDANA','','2019-06-17','05:00:00','07:30:00','ಶಾಸಕರ ಕಚೇರಿ ಹೊನ್ನಾವರ','','2019-06-16 14:36:19','2019-06-16 14:39:06'),(125,'BHAGYALAXMI BOND DISTRIBUTION','','2019-06-17','10:00:00','11:30:00','ಹೊನ್ನಾವರ','ಸಮಾಜದಲ್ಲಿ ತಲತಲಾಂತರದಿಂದ ರೂಡಿಯಲ್ಲಿರುವ ಮೂಡನಂಬಿಕೆಗಳಲ್ಲಿ ಹೆಚ್ಚಿನವು ಒಳಗೊಳ್ಳುವುದು ಮಹಿಳೆಯನ್ನು. ಸಂಪ್ರದಾಯ ಮತ್ತು ನಂಬಿಕೆಗಳನ್ನು ಹುಟ್ಟುಹಾಕುವುದು ಪ್ರಮುಖವಾಗಿ ಸಮಾಜದ ಪುರುಷ ಪ್ರದಾನ ಪ್ರವೃತ್ತಿ. ಇದರಿಂದ  ಹುಟ್ಟಿದ ಮೂಡನಂಬಿಕೆಗಳಿಗೆ ಹೆಣ್ಣೆ ಮುಖ್ಯವಾಗಿ ಗುರಿಯಾಗುತ್ತಾಳೆ\r\n\r\nಮಾನವ ಜನ್ಮದಲ್ಲಿಯೇ ಹೆಣ್ಣಿನ ಜನ್ಮ ಶ್ರೇಷ್ಠವಾದಂತಹ ಜನ್ಮ. ಹೆಣ್ಣು ಮಗು ಹುಟ್ಟಿದರೆ ಅದು ಶಾಪವಲ್ಲ, ಬದಲಾಗಿ ವರ ಎಂದು ಖಚಿತಪಡಿಸಲು ಸನ್ಮಾನ್ಯ ಮಾಜಿ ಮುಖ್ಯಮಂತ್ರಿಗಳಾದ ಯಡಿಯೂರಪ್ಪನವರ ಆಗಿನ ಸರ್ಕಾರ 2006-07 ರಲ್ಲಿ ಭಾಗ್ಯಲಕ್ಷ್ಮಿ ಯೋಜನೆ ಜಾರಿಗೆ ತಂದಿದ್ದರು. \r\n\r\nಬಡತನ ರೇಖೆಗಿಂತ ಕೆಳಗಿನ ಕುಟುಂಬದಲ್ಲಿ ಜನಿಸಿದ ಎರಡು ಹೆಣ್ಣು ಮಕ್ಕಳಿಗೆ ಯೋಜನೆಯ ಲಾಭ ದೊರೆಯಲಿದೆ. ಹೆಣ್ಣು ಮಕ್ಕಳಿಗೆ ಶಿಕ್ಷಣ ಕೊಡಿಸುವಲ್ಲಿ ಪೋಷಕರು ಹಿಂದೇಟು ಹಾಕಬಾರದು. ಹೆಣ್ಣೊಂದು ಕಲಿತರೆ ಶಾಲೆಯೊಂದು ತೆರೆದಂತೆ ಎಂಬ ನಾಣ್ನುಡಿಯನ್ನು ನಿಜ ಮಾಡಬೇಕು. ಮಹಿಳಾಪರ ಕಾಳಜಿ ಇರುವ ಈ ಯೋಜನೆ ನಿರಂತರವಾಗಿ ಮುಂದುವರಿಯಲಿದೆ.\r\n\r\nಈ ನಿಟ್ಟಿನಲ್ಲಿ ಕಳೆದ ಕೆಲವು ವರ್ಷಗಳಿಂದ ಬಾಕಿ ಉಳಿದಿದ್ದ, *ಹೊನ್ನಾವರ ತಾಲ್ಲೂಕಿನ* ಸರಿ ಸುಮಾರು *125 ಭಾಗ್ಯಲಕ್ಷ್ಮಿ* ಯೋಜನೆಯನ್ನು ಬಾಂಡ್ ನ್ನು ಇಂದು ಫಲಾನುಭವಿಗಳಿಗೆ ವಿತರಿಸಲಾಯಿತು','2019-06-16 14:38:48','2019-06-17 10:53:34'),(126,'COMMITTEE MEETING','','2019-06-18','18:53:00','18:29:00','ಬೆಂಗಳೂರು ','','2019-06-17 14:53:54','2019-06-17 14:53:54'),(127,'CONSTITUENCY WORK','','2019-06-19','18:30:00','18:29:00','ಬೆಂಗಳೂರು ','','2019-06-18 15:02:47','2019-06-18 15:02:47'),(128,'CM Relief Cheque Distribution to Beneficiary ','','2019-06-20','05:00:00','06:00:00','ತಾಲ್ಲೂಕು ಪಂಚಾಯಿತಿ ಸಭಾಂಗಣ ಭಟ್ಕಳ ','','2019-06-19 13:55:20','2019-06-19 13:55:20'),(129,'Visit To Nagabhan ','','2019-06-20','06:00:00','07:00:00','ಭಟ್ಕಳ ','','2019-06-19 13:57:00','2019-06-19 13:57:00'),(130,'MALERIYA VIRODHI MAASACHARANE INNAGURATION','ಆರೋಗ್ಯ ಮತ್ತು ಕುಟುಂಬ ಕಲ್ಯಾಣ ಇಲಾಖೆ ಭಟ್ಕಳ, ಇವರ ವತಿಯಿಂದ,  *ಮಲೇರಿಯಾ ವಿರೋಧಿ ಮಾಸಾಚರಣೆ ಜೂನ್ 2019* ಕಾರ್ಯಕ್ರಮವನ್ನು ಉದ್ಘಾಟಿಸಲಾಯಿತು.\r\n\r\nಈಗಾಗಲೇ ಮಳೆಗಾಲ ಪ್ರಾರಂಭವಾಗಿದೆ. ಮಳೆಗಾಲದ ಜೊತೆ ಜೊತೆಗೆ ಹತ್ತು ಹಲವು ರೋಗಗಳೂ ಮನುಷ್ಯನನ್ನು ಕಾಡಲು ಪ್ರಾರಂಭವಾಗುತ್ತದೆ. ಕಾರಣ ಜನರು ತಮ್ಮ ಸುತ್ತಮುತ್ತಲಿನ ಪ್ರದೇಶಗಳನ್ನು ಮಾಲಿನ್ಯ ಮಾಡದೆ ಶುಚಿಯಾಗಿರುವಂತೆ ನೋಡಿಕೊಳ್ಳುವುದರ ಮೂಲಕ ರೋಗಗಳಿಂದ ರಕ್ಷಣೆಯನ್ನು ಪಡೆಯಬೇಕು.\r\n\r\nಮಳೆಗಾಲದಲ್ಲಿ ಸಾಮಾನ್ಯವಾಗಿ ಕಂಡುಬರುವಂತಹ ರೋಗಗಳ ಬಗ್ಗೆ ಅರಿವು ಮೂಡಿಸುವ ಮತ್ತು ಮಾಹಿತಿಯನ್ನು ನೀಡುವ ಇಂತಹ  ಕಾರ್ಯಕ್ರಮಗಳು ಎಲ್ಲಾ ಶಾಲಾ ಕಾಲೇಜುಗಳಲ್ಲಿ ನಡೆದರೆ ಜನರಲ್ಲಿ ಜಾಗೃತಿ ಮೂಡಿಸಲು ಸಹಕಾರಿಯಾಗಲಿದೆ.','2019-06-21','04:30:00','05:30:00','ಶ್ರೀ ಗುರು ಸುಧೀಂದ್ರ ಮಹಾವಿದ್ಯಾಲಯ ಸಭಾಭವನ ಭಟ್ಕಳ','','2019-06-20 14:25:57','2019-06-21 10:31:34'),(131,'B C M HOSTEL COMMITTEE MEETING','','2019-06-21','06:30:00','07:30:00','ಶಾಸಕರ ಕಚೇರಿ ,ತಾಲೂಕು ಪಂಚಾಯತ ಭಟ್ಕಳ','','2019-06-20 14:27:45','2019-06-20 14:27:45'),(132,'PRIVATE FUNCTION','','2019-06-21','09:30:00','14:30:00','ಖಾಸಗಿ ಕಾರ್ಯಕ್ರಮ','','2019-06-20 14:28:41','2019-06-20 14:28:41'),(133,'PRIVATE FUNCTION','','2019-06-22','04:30:00','14:30:00',