, ನಂಬಿಕೆ, ಅಕ್ಕರೆ,ಒಲವು.\r\n\r\nಬದುಕು ಸಾವುಗಳ ನಡುವಿನ ಒಂದು ಜೀವಂತ ಕೊಂಡಿಯಾಗಿರುವ ಆಪತ್ತದ್ಬಾಂಧವ ಎಂದರೆ ವೈದ್ಯರು‌. ಹಿಂದಿನ ಕಾಲದಿಂದಲೂ ವೈದ್ಯ ವೃತ್ತಿಗೆ ಸಾಕಷ್ಟು ಮನ್ನಣೆ ನೀಡಲಾಗಿದೆ. ವೈದ್ಯರು ನಿಜವಾದ ಅರ್ಥದ ಶ್ರಮ ಜೀವಿ\r\n\r\nಇಂದು ವೈದ್ಯರ ದಿನಾಚರಣೆ, ವೈದ್ಯರಿಗೆ ಕೃತಜ್ಞತೆ ಸಲ್ಲಿಸುವ ದಿನ. \r\n\r\nಎಲ್ಲಾ ವೈದ್ಯರನ್ನು ಅವರ ಕುಟುಂಬವನ್ನು ಭಗವಂತನು ಅರೋಗ್ಯ ಭಾಗ್ಯ ನೀಡಿ ಕರುಣಿಸಲಿ ಎಂದು ಭಗವಂತನಲ್ಲಿ ಹಾರೈಸುತ್ತಾ. ಎಲ್ಲ‌ ವೈದ್ಯರಿಗೆ ರಾಷ್ಟ್ರೀಯ ವೈದ್ಯರ ದಿನಾಚರಣೆಯ ಶುಭಾಶಯಗಳು. \r\n\r\nಇಂದು ಭಟ್ಕಳ ತಾಲ್ಲೂಕು ಆಸ್ಪತ್ರೆಯಲ್ಲಿ ವೈದ್ಯರ ದಿನಾಚರಣೆಯ ಅಂಗವಾಗಿ ನಡೆದ ರಕ್ತದಾನ ಶಿಬಿರವನ್ನು ಉದ್ಘಾಟಿಸಿ ವೈದ್ಯರಿಗೆ ಸನ್ಮಾನಿಸಲಾಯಿತು. ','2019-06-30 13:56:31','2019-07-01 05:36:25'),(151,'ENGLISH MEDIUM DIVISION OPENING FUNCTION','','2019-07-01','04:45:00','04:50:00','ಸರಕಾರಿ ಹಿರಿಯ ಪ್ರಾಥಮಿಕ ಶಾಲೆ ಚಿತ್ತಾರೆ.ಮಂಕಿ','','2019-06-30 13:59:07','2019-06-30 13:59:07'),(152,'KRISHI ABHIYANA','','2019-07-01','05:00:00','05:30:00','ಬಳ್ಖುರು,ಹೊನ್ನಾವರ','','2019-06-30 14:00:19','2019-06-30 14:00:19'),(153,'JANASPANDANA','','2019-07-01','06:00:00','20:30:00','ಶಾಸಕರ ಕಚೇರಿ,ಹೊನ್ನಾವರ','','2019-06-30 14:01:14','2019-06-30 14:01:14'),(154,'INTERNATIONAL DOCTORS DAY FUNCTION','','2019-07-01','09:30:00','10:00:00','ಪ್ರಾಥಮಿಕ ಆರೋಗ್ಯ ಕೇಂದ್ರ ,ಶಿರಾಲಿ','','2019-06-30 14:03:13','2019-06-30 14:03:13'),(155,' PRIVATE FUNCTION','','2019-07-01','10:30:00','14:30:00','ಖಾಸಗಿ ಕಾರ್ಯಕ್ರಮ','','2019-06-30 14:04:34','2019-06-30 14:04:34'),(156,'COMMITTE MEETING AT VIDHANASOUDHA','','2019-07-02','00:30:00','18:29:00','ಬೆಂಗಳೂರು','','2019-07-02 03:21:59','2019-07-02 03:21:59'),(157,'CONSTITUENCY WORK IN VIDHANASOUDHA','','2019-07-03','18:30:00','18:29:00','ಬೆಂಗಳೂರು','','2019-07-02 03:23:51','2019-07-02 03:23:51'),(158,'PRIVATE FUNCTION','','2019-07-04','04:30:00','14:30:00','ಖಾಸಗಿ ಕಾರ್ಯಕ್ರಮ','','2019-07-04 05:55:19','2019-07-04 05:55:19'),(159,'ROAD GUDDALI PUJE','','2019-07-05','04:30:00','05:30:00','ಇಡಗುಂಜಿ ಪಂಚಾಯತ ಬಾಳುಬೆಲೆ','ಹೊನ್ನಾವರ ತಾಲ್ಲೂಕಿನ ಕೆಳಗಿನ ಇಡಗುಂಜಿಯ ಬಾಳುಬೇಲೆ ರಸ್ತೆ ಕಾಂಕ್ರೀಟೀಕರಣ ಕಾಮಗಾರಿಗೆ ಗುದ್ದಲಿ ಪೂಜೆಯನ್ನು ನೆರವೇರಿಸಲಾಯಿತು','2019-07-04 14:57:49','2019-07-05 06:41:19'),(160,'ROAD GUDDALI PUJE','','2019-07-05','0