ಾನ್ ಮುಗ್ದ ಜನರು, ಇವರೇ ಕಡುಗಡಲ ನೀಲಿಯೊಳು ಎಡೆ ಬಿಡದೆ ದುಡಿಯುವರು, ಒಡಲ ತುತ್ತನ್ನು ಹುಡುಕಿ ನಡು ನೀರಿಗಿಳಿಯುವರು.. ಇವರೇ ನಮ್ಮ *ಮೊಗವೀರರು*\r\n\r\n ಇಂದು ಮೀನುಗಾರ ಕುಟುಂಬ ಹಲವು ಸಾವು ನೋವನ್ನು ಅನುಭವಿಸುತ್ತಿದೆ. ಈ ನೋವಿಗೆ ಧೈರ್ಯ ತುಂಬುವ ಸಲುವಾಗಿ ಎಲ್ಲಾ ಕಲಾಸಿಗಳು, *ಭಟ್ಕಳ ತಾಲೂಕಾ ಮೀನುಗಾರಿಕಾ ಕಲಾಸಿ ಸಂಘವನ್ನು  ತೆರೆದಿದ್ದು,* ಮೀನುಗಾರಿಕೆಯ ಸಮಯದಲ್ಲಿ ಜೀವ ಕಳೆದುಕೊಂಡ ಹಲವು ಕುಟುಂಬಗಳಿಗೆ ಮತ್ತು ಮೊನ್ನೆ ನಡೆದ ರಸ್ತೆ ಅಪಘಾತದಲ್ಲಿ ಮೃತಪಟ್ಟಂತಹ ಕುಟುಂಬಕ್ಕೆ ಪರಿಹಾರ ಧನವನ್ನು ವಿತರಿಸುವ ಮೂಲಕ ಅರ್ಥಪೂರ್ಣವಾಗಿ ಹೆಜ್ಜೆಯನ್ನು ಇಟ್ಟಿದ್ದಾರೆ.\r\n\r\nಈ ಒಂದು ಅದ್ಭುತ ಕಾರ್ಯಕ್ರಮದ ಉದ್ಘಾಟಕನಾಗಿ, ಕಾರ್ಯಕ್ರಮವನ್ನು ಉದ್ಘಾಟಿಸಿದ್ದು  ನನ್ನ ಅದೃಷ್ಟ ಎಂದು ಹೇಳುತ್ತಾ ಸಂಘಕ್ಕೆ ಶುಭಹಾರೈಸುತ್ತೇನೆ\r\n','2019-07-25 07:51:45','2019-07-25 07:54:17'),(188,'Higher Primary School Building Collapse Inspection','','2019-07-25','11:00:00','11:30:00','ಹೊನ್ನೆಮಿಡಿ, ಬೆಳಕೆ','ಭಟ್ಕಳ ತಾಲ್ಲೂಕಿನ ಬೆಳ್ಕೆ ಪಂಚಾಯತ್ ವ್ಯಾಪ್ತಿಯ ಸರ್ಕಾರಿ ಹಿರಿಯ ಪ್ರಾಥಮಿಕ ಶಾಲೆ ಹೊನ್ನೇಮಿಡಿ ಶಾಲೆಗೆ ಕೆಲ ತಿಂಗಳ ಹಿಂದೆ 10 ಲಕ್ಷ ರೂ ವೆಚ್ಚದಲ್ಲಿ ನೂತನ ಕೊಠಡಿಯನ್ನು ನಿರ್ಮಿಸಿದ್ದು ಈಗ ಶಾಲೆಯ ಹಳೆಯ ಎರಡು ಕೊಠಡಿಗಳು ಕುಸಿದು ಬಿದ್ದಿದೆ, ಕಾರಣ ಕ್ಷೇತ್ರದ ಶಿಕ್ಷಣಾಧಿಕಾರಿಗಳೊಂದಿಗೆ ಸ್ಥಳಕ್ಕೆ ಭೇಟಿ ನೀಡಿ ಶಾಲ ಮಕ್ಕಳ ಹಿತದೃಷ್ಟಿಯಿಂದ ಆ ಎರಡು ಕೊಠಡಿಗಳನ್ನು ಸಂಪೂರ್ಣ ನೆಲಸಮ ಮಾಡುವಂತೆ ಆದೇಶಿಸಿ, ಸಂಪೂರ್ಣ ಶಾಲೆಯ ಹೊಸ ಕಟ್ಟಡ ನಿರ್ಮಾಣಕ್ಕೆ ಬೇಕಾದ ಅಗತ್ಯ ಕ್ರಮವನ್ನು ಕೈಗೊಳ್ಳಲಾಯಿತು.','2019-07-25 10:57:41','2019-07-26 05:47:25'),(189,' Puravrga Land Slide Spot Inspection','','2019-07-25','11:30:00','12:00:00','ಪುರವರ್ಗ, ಬಟ್ಕಳ','ಕಳೆದ ಒಂದು ತಿಂಗಳಿಂದ ಎಡೆ ಬಿಡದೆ ಸುರಿಯುತ್ತಿರುವ ಮಳೆಯಿಂದಾಗಿ ಭಟ್ಕಳ ತಾಲ್ಲೂಕಿನಾದ್ಯಂತ ನೆರೆಹಾವಳಿ ಯಾಗಿದ್ದು ಮನೆಗಳಿಗೆ ನೀರು ನುಗ್ಗಿದೆ. ಕಾರಣ ಭಟ್ಕಳ ತಹಶೀಲ್ದಾರ್ ಮತ್ತು ಐ. ಆರ್. ಬಿ. ಇಂಜಿನಿಯರ್ ಗಳೊಂದಿಗೆ, ಪುರವರ್ಗ, ಮೂಡ ಭಟ್ಕಳ, ರಾಘವೇಂದ್ರ ಮಠ, ಮಣ್ಕುಳಿ ಬೈ ಪಾಸ್ ಗಳಿಗೆ ಭೇಟಿ ನೀಡಿ ತಾತ್ಕಾಲಿಕವಾಗಿ ನೀರು ನಿಲ್ಲುವ ಹಳ್ಳಗಳಲ್ಲಿನ ಹೂಳೆತ್ತುವಂತೆ, ಮೂಡ ಭಟ್ಕಳ ಹೊಳೆಯ ಇಕ್ಕೆಲಗಳಲ್ಲಿ ತುಂಬಿರುವಂತಹ ಕಸದ ರಾಶಿ, ಗಿಡಗಳನ್ನು ತೆಗೆಯುವಂತೆ ಆದೇಶಿಸಲಾಯಿತು.\r\n\r\nರಾಷ್ಟ್ರೀಯ ಹೆದ್ದಾರಿ ಅಗಲೀಕರಣ ಕಾಮಗಾರಿ ಸಂಪೂರ್ಣವಾಗಿ ಮುಗಿದ ನಂತರ ಈ ಸಮಸ್ಯೆಗೆ ಶಾಶ್ವತ ಪರಿಹಾರ ಕಂಡುಕೊಳ್ಳಲಾಗುವುದು.\r\n','2019-07-25 10:59:07','2019-07-26 05:44:42'),(190,' Bhatkal mankuli IRB work Progress Inspection','','2019-07-25','12:00:00','13:00:00','ಮಣಕುಲೀ, ಭಟ್ಕಳ','ಕಳೆದ ಒಂದು ತಿಂಗಳಿಂದ ಎಡೆ ಬಿಡದೆ ಸುರಿಯುತ್ತಿರುವ ಮಳೆಯಿಂದ