INSERT INTO `feedbacks` VALUES (10,17,8,312,'ನಮಸ್ತೆ ಸರ್, \r\n  ನಾವು ಭಟ್ಕಳದ ರಂಗಿನಕಟ್ಟೆಯ ನಾಗಪ್ಪ ನಾಯಕ ರೋಡ್  2ನೇ ಕ್ರಾಸ್ (ಒಂದನೇ ಎಡ ಬದಿ ಅಡ್ಡ ರಸ್ತೆ, ಖಾಜಿಯಾ ರೆಸ್ಸಿಡೆನ್ಸಿ ಪಕ್ಕದ ರಸ್ತೆ)  ಪುರಸಭೆಯ ವ್ಯಾಪ್ತಿಗೆ ಬರುತ್ತಿದ್ದು \r\n, ನಾವು ಹಲವು ವರ್ಷಗಳಿಂದ ಒಳ ಚರಂಡಿ ಮತ್ತು ಗಟಾರ ಸಮಸ್ಯೆಗಳಿಗೆ ಎದುರಾಗಿದ್ದೇವೆ. ಪ್ರತಿ ವರ್ಷವೂ ಮಳೆಗಾಲದಲ್ಲಿ ಮನೆ ಅಂಗಳದಲ್ಲಿ ನೀರುಗಳು ನೆಲೆ ನಿಂತು ಸಂಕಷ್ಟದ ಪರಿಸ್ಥಿತಿ ಎದುರಿಸುತ್ತಿದ್ದೇವೆ. ದಯವಿಟ್ಟು ನಮ್ಮ ಈ ಮನವಿಯನ್ನು ಸ್ವೀಕರಿಸಿ ಆದಷ್ಟು ಬೇಗನೆ ಸಮಸ್ಯೆವನ್ನು ಬಗೆಹರಿಸಬೇಕೆಂದು ನಾನು ತಮ್ಮಲ್ಲಿ ವಿನಂತಿಸಿಕೊಳ್ಳುತ್ತೇನೆ ..\r\n\r\nಧನ್ಯವಾದಗಳೊಂದಿಗೆ,','Requirement','ತಮ್ಮ ಬೇಡಿಕೆಯನ್ನು ಮುಖ್ಯಾಧಿಕಾರಿಗಳ ಗಮನಕ್ಕೆ ತಂದಿದ್ದು ಶೀಘ್ರದಲ್ಲಿ ಸಮಸ್ಯೆಗೆ ಪರಿಹಾರಕಂಡುಕೊಳ್ಳಲಾಗುವುದು-ಧನ್ಯವಾದಗಳು','ಗಟಾರ ಮತ್ತು ಒಳಚರಂಡಿ ಸಮಸ್ಯೆ ಕುರಿತು','2019-04-29 14:50:50','2019-05-06 05:36:55',253),(11,17,27,374,'Why there is not even a single sleeper ksrtc bus from bhatkal to bangalore. Daily hundreds of people are travelling and its becoming very difficult for us to find the buses to bhatkal. Where as from sirsi there are more than 8 sleeper busses. Why cant the same facility provided to bhatkal people. ','Requirement','ಈಗಾಗಲೇ ರಾತ್ರಿ 7.00 ಗಂಟೆಯ ರಾಜಹಂಸ ಬಸ್‌ ಬದಲಾಗಿ ಸ್ಲೀಪರ್‌ ಬಸ್‌ ಬಿಡುವುದಕ್ಕೆ ಶಿಫಾರಸ್ಸು ಮಾಡಲಾಗಿದ್ದು ಶೀಘ್ರದಲ್ಲಿ ವ್ಯವಸ್ಥೆಮಾಡಲಾಗುವುದು - ಧನ್ಯವಾದಗಳು','We need non AC sleeper buses from bhatkal to bangalore. ','2019-04-30 07:09:38','2019-05-06 04:46:33',295),(20,28,5,134,'We have serious issues with water.\r\nKindly provide any solution. ','Requirement','ದಿನಾಂಕ 16-02-2019 ರಂದು ಶಾಸಕರ ಅಧ್ಯಕ್ಷತೆಯಲ್ಲಿ ನಡೆದ ಜಾಲಿ ಪಟ್ಟಣ ಪಂಚಾಯತ ಟಾಸ್ಕ ಫೋರ್ಸ್‌ ಸಮೀತಿಯ ಸಭೆಯಲ್ಲಿ ಶಾಸಕರು ಕುಡಿಯುವ ನೀರಿನ ಸಮಸ್ಯೆಯನ್ನು ಅರಿತು ವೆಂಕಟಾಪುರ ಕರಾವಳಿ ಕಾವಲುಪಡೆಯ ಹಿಂಭಾಗದ ಪ್ರದೇಶದಲ್ಲಿ ಕೊಳವೆ ಬಾವಿ ತೆಗೆದು ಪಂಪ  ಅಳವಡಿಸಲು  ರೂ.205000.00 ಗಳನ್ನು ಕಾಯ್ದಿಟ್ಟಿದ್ದು ಟೆಂಡರ್‌ ಹಂತದಲ್ಲಿರುತ್ತದೆ.ದಿನಾಂಕ 02-05-2019 ಟೆಂಡರ ಗೆ ಕೊನೆಯ ದಿನಾಂಕವಾಗಿದ್ದು ,ಟೆಂಡರ ಪ್ರಕ್ರಿಯೆ ಮುಗಿದನಂತರ ಶೀಘ್ರದಲ್ಲಿ ಸಮಸ್ಯೆಯನ್ನು ಪರಿಹರಿಸಲಾಗುವುದು.\r\nಸಲಹೆಗಳಿಗೆ ಧನ್ಯವಾದಗಳು','Water problem ','2019-04-30 08:06:26','2019-05-01 04:44:04',308),(22,15,1,112,'Dear sir, can you please check and let us know what is the reasons for road construction is not completed in this particular area? Its been more than 2+ years\r\n\r\nThanks,','Complaint','','ರಸ್ತೆ ಕಾಮಗಾರಿ ಅರ್ದಕ್ಕೆ ನಿಂತ ಕುರಿತು ','2019-04-30 15:51:11','2019-05-01 05:18:08',460),(24,30,3,342,'ಹೊಳೆ ಪಾಯ್ಪ ಕೆಳಿ','Requirement','ನಿಮ್ಮ ಸಮಸ್ಯೆಯನ್ನು ವಿವರಿಸಲ್ಲವಾದ್ದರಿಂದ ವಿಷಯ ತಿಳಿಯುತ್ತಿಲ್ಲ.ಕಾರಣ ಸಮಸ್ಯೆ ಮತ್ತು ಪರಿಹಾರ ಮಾರ್ಗದ ಬಗ್ಗೆ ವಿವರವಾಗಿ ಬರೆದು ಹೊಸ ದೂರನ್ನು ದಾಖಲಿಸಿ','Hole paip innu hakilla sir','2019-04-30 17:45:34','2019-05-01 05:59:50',442),(25,17,8,83,'ಮುಟ್ಟಳ್ಳಿಯಿಂದ ರೈಲ್ವೇ ಸ್ಟೇಷನ್ ಗೆ ಹೋಗುವ ರಸ್ತೆಗೆ ಹೊಸದಾಗಿ ಸಿ.ಸಿ. ರಸ್ತೆ ಕಾಮಗಾರಿ ನಡೆಸಿರುವುದು ನಮ್ಮೆಲ್ಲರಿಗೂ ಸಂತೋಷದ ವಿಷಯ...ಆದರೆ ಸಿ.ಸಿ ರಸ್ತೆಯ ಎರಡು ಬದಿಯಲ್ಲಿ ಮಣ್ಣು ತುಂಬುವ ನೆಪದಲ್ಲಿ ಇಡೀ ರಸ್ತೆಯ ಮೇಲೆ ಕೆಂಪು ಮಣ್ಣನ್ನು ಹಾಕಲಾಗಿದೆ. ಇದರಿಂದ ದೂಳು ಉದ್ಬವಿಸುತ್ತಿದ್ದು ಸಾರ್ವಜನಿಕರಿಗೆ ಸಂಚಾರಕ್ಕೆ ತುಂಬಾ ತೊಂದರೆಯಾಗುತ್ತಿದೆ.  ಅಳೆಯ ರಸ್ತೆಗಿಂತಲು ಕಡೆಯಾದ ರೀತಿ ಬೇಜವಬ್ದಾರಿತ ಕೆಲಸ ನಿರ್ವಹಿಸಿರುವ ಟೆಂಡರುದಾರರ ಮೇಲೆ ಸೂಕ್ತ ಕೈಗೊಳ್ಳಬೇಕು. ಅಲ್ಲದೇ ಅತೀ ತುರ್ತಾಗಿ ಇದನ್ನು ಸರಿಪಡಿಸುವಂತೆ ಸಂಬಂಧ ಪಟ್ಟವರಿಗೆ ಸೂಚಿಸಲು ಕೋರಿದೆ','ದೂರು - Complaint','ದೂರನ್ನು ಸಂಭಂದಿಸಿದ ಇಲಾಖೆಗೆ ವರ್ಗಾಯಿಸಲಾಗಿದ್ದು ಸೂಕ್ತ ಕ್ರಮ ಕೈಗೊಳ್ಳಲಾಗುವುದು.','ಮುಟ್ಟಳ್ಳಿಯ ರೈಲ್ವೇ ಸ್ಟೇಷನ್ ಮಾರ್ಗವಾಗಿ ಹೊಸದಾಗಿ ನಿರ್ಮಾಣವಾದ ಸಿ.ಸಿ‌ ರಸ್ತೆಯ ಮೇಲೆ  ಕೆಂಪು ಮಣ್ಣನ್ನು ಹಾಕಿರುವ ಬಗ್ಗೆ','2019-05-01 01:47:23','2019-05-14 04:14:50',493),(31,15,3,46,'ಭಟ್ಕಳದಿಂದ ಸರ್ಪನ ಕಟ್ಟೆ ಕೋಣಾರ ಕುಂಟ ವಾಣಿ ಮಾರ್ಗವಾಗಿ ಕುಳುವಾಡಿಗೆ ಪ್ರತಿನಿತ್ಯ ೬ ಬಸ್ಸುಗಳು ಸಂಚರಿಸುತ್ತಿದ್ದು ರಸ್ತೆಯ ಇಕ್ಕೆಲಗಳಲ್ಲಿ ಖಾಸಗಿ ವ್ಯಕ್ತಿಗಳಿಗೆ ಸೇರಿದ ಗಿಡ ಮರಗಳು ಹಾಗೂ ಅರಣ್ಯ ಇಲಾಖೆಗೆ ಸೇರಿದ ಮರ ಗಿಡಗಳು ರಸ್ತೆಗೆ ಚಾಚಿಕೊಂಡಿರುವದರಿಂದ ಈ ರಸ್ತೆಯಲ್ಲಿ ವಾಹನ ನಡೆಸುವುದು ದುಸ್ತರವಾಗಿದೆ ದಯಮಾಡಿ ಅದನ್ನು ಸ್ವಚ್ಛಗೊಳಿಸಿ ಸುಗಮ ಸಂಚಾರಕ್ಕೆ ಅನುವು ಮಾಡಿಕೊಡಬೇಕಾಗಿ ವಿನಂತಿಸುತ್ತೇನೆ.','Requirement','','ರಸ್ತೆ ಸುರಕ್ಷತೆ','2019-05-01 04:02:01','2019-05-01 05:30:47',373),(32,29,8,134,'ಸರ್,ವೆಂಕ್ಟಾಪುರದಲ್ಲಿ ಕುಡಿಯುವ ನೀರಿನ ಸಮಸ್ಯೆ ತುಂಬಾ ಇದೆ. ಮತ್ತು ಒಂದು ರೋಡ್ ಮಾಡಿ ಕೊಡಿ ಅಂತಾ ಹೇಳಿ ಹೇಳಿ ಸಾಕಾಗಿದೆ.ಮಳೆಗಾಲ ಬಂದ್ರೆ ಆ ರೋಡ್ ಹೊಳೆ ರೀತಿ ಆಗಿರುತ್ತೆ ದಯವಿಟ್ಟು ನೀವಾದರೂ ಆ ರೋಡ್ ನ್ನ ಸರಿಮಾಡಿಸಿಕೊಡಿ..ಇದರಿಂದ 20 ರಿಂದ 30 ಮನೆಯವರಿಗೆ ತುಂಬಾ ಅನುಕೂಲವಾಗುತ್ತೆ..','ಬೇಡಿಕೆ - Requirement','ಕಾಮಗಾರಿ ಕೋರಿಕೆಯನ್ನು ಪರಿಗಣಿಸಿ ಕ್ರಿಯಾಯೋಜನೆಯಲ್ಲಿ ಸೇರಿಸಲಾಗಿದೆ.','ನೀರಿನ ಸಮಸ್ಯೆ ಮತ್ತು ರೋಡಿನ ಸಮಸ್ಯೆ','2019-05-01 04:31:53','2019-05-14 04:15:43',466),(36,16,3,342,'Dear sir\r\n\r\nಮಂಕಿ ಗ್ರಾಮದ ಬಾಲಯ್ಯನವಾಡೆಯ ನಿವಾಸಿ ಈಶ್ವರ್ ಗುರುನಾಥ ನಾಯ್ಕ ಆದ ನಾನು ಈ ಮೂಲಕ ತಿಳಿಸುವುದೇನೆಂದರೆ ಕಳೆದ ವರ್ಷ ಬೇಸಿಗೆಯಲ್ಲಿ ನಮ್ಮ ಊರ ಜನರು ಸೇರಿ ಹಣವನ್ನು ಅವರಿವರಿಂದ ಸಂಗ್ರಹಿಸಿ ಹಾಗೂ ತಾವೇ ಸ್ವತಃ ಹಣವನ್ನು ಹಾಕಿ ಹಳೆಯ ಒಡ್ಡು ಒಡೆದು ಹೋಗಿ ಹಾಳಾದ ಹೊಳೆಯನ್ನು ಪುನರ್ ಸ್ಥಾಪಿಸುವ ಕಾರ್ಯವನ್ನು ಕೈಗೊಂಡಿದೆವು. ಅದರಂತೆ ಹೊಳೆಯ ಹೂಳೆತ್ತುವ ಮತ್ತು ಹೊಳೆಯ  ಕುರಹು ಇಲ್ಲದ ಜಾಗದಲ್ಲಿ ಸರ್ವೇ ಮೂಲಕ ಅದನ್ನು ತಿಳಿದು ಅಲ್ಲಿ  ಹೊಳೆಯನ್ನು ಪುನರ್ ಸ್ಥಾಪಿತವಾಗುವಂತೆ ಮಾಡಲಾಗಿತ್ತು. ಆದರೆ ಹೊಳೆಗೆ ಗದ್ದೆಯ ನೀರು ಹರಿದುಹೋಗಲು ಪೈಪ್ ಅಳವಡಿಸುವ ಅವಶ್ಯಕತೆ ಇದ್ದು ಅದನ್ನು ಅಳವಡಿಸುವಂತೆ ಮನವಿ ಮಾಡಲಾಗಿತ್ತು. ಆದರೆ ಅದನ್ನು ಅಳವಡಿಸದ ಕಾರಣ ಊರ ನಾಗರಿಕರು ಸೇರಿ ಹಣವನ್ನು ಸಂಗ್ರಹಿಸಿ ನಾಲ್ಕೈದು ಪೈಪ್ ಅವಶ್ಯಕತೆಯಲ್ಲಿ ಕೇವಲ ಒಂದು ಪೈಪ್ ಅಳವಡಿಸಿಕೊಳ್ಳಲು ಶಕ್ತವಾಯಿತು. ಉಳಿದ ಪೈಪನ್ನು ಅಳವಡಿಸಿಕೊಡುವಂತೆ ತಮ್ಮಲ್ಲಿ ಪುನರ್ ಮನವಿ ಮಾಡಿಕೊಳ್ಳುತ್ತಿದ್ದೇವೆ.','Requirement','','ಮಂಕಿ ಗ್ರಾಮದ, ಬಾಲಯ್ಯನವಾಡೆಯಿಂದ ಹರಿದು ಹೋಗುವ ಹೊಳೆಗೆ ಪಾಯ್ಪ ಅಳವಡಿಸುವಂತೆ ಕೋರಿ','2019-05-01 07:02:28','2019-05-01 10:36:24',442),(41,16,5,211,'ಸರಳ ಗಿ ಗ್ರಾಮದಲ್ಲಿ ಯಾವಾಗಲೂ ಕುಡಿಯುವ ನೀರಿನ ಸಮಸ್ಯೆ ಇದ್ದು ಇದಕ್ಕೇ ಪರಿಹಾರವೇ ಇಲ್ಲದಂತಾಗಿದೆ ದಯವಿಟ್ಟು ನಮ್ಮ್ ಊರಿನ ಸಮಸ್ಯ್ ವನ್ನು ಬೇಗ ಬಗೆಹರಿಸ ಬೇಕಾಗಿ ಈ ಮೂಲಕ ವಿನಂತಿ','Complaint','','Waters supply is not working properly','2019-05-01 08:10:36','2019-05-01 10:40:32',100),(43,29,8,69,'ಮಾನ್ಯ ಶಾಸಕರೆ ಹೆಬಳೆಯ ಗಾಂಧಿನಗರದ ಗಣೇಶ ಸಮುದಾಯ ಭವನದಿಂದ ಶೆಟ್ಟಿ ಹೋಟೆಲ್ ಮಾರ್ಗ ವಾಗಿ ಚರಂಡಿ ವ್ಯವಸ್ಥೆ ಕಾಮಗಾರಿ ಪೂರ್ತಿಯಾಗದೆ ಹಾಗೆ ಇದ್ದು ಸುಮಾರು  8 ವರ್ಷ ಆಗಿರುತ್ತದೆ ಇದಕ್ಕೆ ಸಭಂದ ಪಟ್ಟಂತೆ ದುರಸ್ತಿಗಾಗಿ ಇಲಾಖೆಗೆ ಹಾಗೂ ಪಂಚಾಯತಗಳಿಗೆ ಸಾಕಷ್ಟು ಬಾರಿ ಮನವಿ ಕೂಡ ಕೋಟ್ಟಿದ್ದೆವೆ ಯಾವುದೆ ಪ್ರಯೋಜನ ಆಗಿಲ್ಲ  ಮಳೆಗಾಲದಲ್ಲಿ ಸರಿಯಾಗಿ ನೀರು ಹೋಗಲು ಆಗದೆ ರಸ್ತೆಯ ಇಕ್ಕೆಲಗಳಲ್ಲಿ ಬಂದು ಸೆರುತ್ತದೆ ಇದರಿಂದ ಸಾರ್ವಜನಿಕರಿಗೆ ತುಂಬಾ ಸಮಸ್ಯೆ ಆಗುತ್ತಿದೆ ಹಾಗಾಗಿ ತಮ್ಮಲ್ಲಿ ವಿನಂತಿ ಏನೆಂದರೆ ನಿಮ್ಮ ಶಾಸಕರ ನಿಧಿಯಿಂದ ಈ ಕಾಮಗಾರಿಯನ್ನು ಪೂರ್ಣಗೊಳಸಬೆಕಾಗಿ ವಿನಂತಿ..\r\n                                ಸಾರ್ವಜನಿಕರು ಗಾಂಧಿನಗರ...','ದೂರು - Complaint','ಕಾಮಗಾರಿ ಕೋರಿಕೆಯನ್ನು ಪರಿಗಣಿಸಿ ಕ್ರಿಯಾಯೋಜನೆಯಲ್ಲಿ ಸೇರಿಸಲಾಗಿದೆ.','ಒಳ ಚರಂಡಿ ವ್ಯವಸ್ಥೆ ಕಾಮಗಾರಿ ','2019-05-01 10:25:20','2019-05-14 04:16:32',555),(45,29,8,495,'ಮಾನ್ಯರೇ,,  ನಾನು ಕೆಳಗಿನಮನೆ, ತೆರ್ನಮಕ್ಕಿಯ ನಿವಾಸಿಯಾಗಿದ್ದು, ಬಿಜೆಪಿ ಕಾರ್ಯಕರ್ತನೂ ಆಗಿರುತ್ತೇನೆ. ನಮ್ಮೂರಿನ ರಸ್ತೆಯು ತುಂಬಾ ವರ್ಷಗಳಿಂದ ಹದಗೆಟ್ಟಿರುತ್ತದೆ. ಕಾರಣ ತಾವು ದಯಮಾಡಿ ರಸ್ತೆಯ ದುರಸ್ತಿ ಕಾರ್ಯ