ಜೋರು ಮಳೆ ಬಂದ್ರೆ ತುಂಬಾ ಕಷ್ಟ ಆಗ್ತದೆ.ದಯವಿಟ್ಟು ಸಂಬಂದ ಪಟ್ಟೋರು ಅದರ ಬಗ್ಗೆ ಗಮನಹರಿಸಬೇಕು','ಬೇಡಿಕೆ - Requirement','ಸಿ.ಸಿ. ರಸ್ತೆ ನಿಮಾಣ ಕಾಮಗಾರಿಗೆ ಅನುಮೋದನೆಯನ್ನು ಸಲ್ಲಿಸಲಾಗಿದ್ದು .ಅನುಮೋದನೆಯ ಹಂತದಲ್ಲಿರುತ್ತದೆ.ಅತೀ ಶಿಘ್ರದಲ್ಲಿ ಅನುಮೋದನೆ ಪಡೆದು ಕಾಮಗಾರಿಯನ್ನು ಪ್ರಾರಂಭಿಸಲಾಗುವುದು.','ರಸ್ತೆ ಸಮಸ್ಯೆಗಳಿವೆ ','2019-05-07 06:09:26','2019-05-14 14:20:17',638),(86,15,8,125,'ಶಾಸಕರ ಸ್ವಕ್ಷೇತ್ರವಾದ ಕೋಟೆಬಾಗಿಲಿನ ಕೋಟೆ ಜಟ್ಗೇಶ್ವರ ದೇವಸ್ಥಾನಕ್ಕೆ ಹೋಗವ ರಸ್ತೆ ಸಂಪೂರ್ಣ ಹದಗೆಟ್ಟಿದ್ದು ಸುಮಾರು ಹತ್ತು ವರ್ಷಗಳಿಂದ ಡಾಂಬರೀಕರಣ ಕಾಣದೆ ಸಂಪೂರ್ಣ ಹದಗೆಟ್ಟಿದೆ ಈ ಬಗ್ಗೆ ಹಲವು ಬಾರಿ ಮನವಿ ಸಲ್ಲಿಸಿದರೂ ಯಾವುದೇ ಕ್ರಮ ಕೈಗೊಂಡಿಲ್ಲ. ಕೂಡಲೇ ನಮ್ಮ ಸಮಸ್ಯೆಗೆ ಸ್ಪಂದಿಸಬೇಕಾಗಿ ವಿನಂತಿ ','ದೂರು - Complaint','ಸದ್ರಿ ರಸ್ತೆಯನ್ನು ಕಾಮಗಾರಿ ಅನುಮೋದನೆಗಾಗಿ ಸಲ್ಲಿಸಲಾಗಿದೆ. ಅನುಮೋದನೆಯ ಹಂತದಲ್ಲಿರುವುದರಿಂದ    ಶ್ರೀಘ್ರದಲ್ಲಿ ಬೇಡಿಕೆಯನ್ನು ಈಡೇರಿಸಲಾಗುವುದು. ಧನ್ಯವಾದಗಳು','ರಸ್ತೆ ಮಂಜೂರು ಮಾಡುವ ಕುರಿತು ','2019-05-09 07:27:07','2019-05-10 13:46:10',726),(94,28,8,1031,'ಮಾನ್ಯರೆ ಈ ವಿಷಯ ಹೇಳಲು ವಿಷಾದವೆನಿಸುತ್ತದೆ . ದೊಡ್ಡಗುಂದದಲ್ಲಿ ಚರಂಡಿ ಕಾಮಗಾರಿ ನಡೆಯಯುತ್ತಿದೆ ಇದು ತುಂಬಾ ಸಂತೋಷದ ವಿಷಯ .ಆದರೆ ಚರಂಡಿಯಲ್ಲಿ ನೀರು ಹೋಗುತ್ತದೆಯೋ ಇಲ್ಲವೋ ಎಂದು ತಿಳಿಯದೆ ಕಾಟಾಚಾರಕ್ಕೆ ಕಾಮಗಾರಿ ಮುಗಿಸಿ ಬಿಲ್ ಮಾಡಿಸಿಕೊಂಡರೆ ಅದರಿಂದ ಆಗುವ ಅನಾಹುತ ಅನುಭವಿಸುವವರು ನಾವು. ಮಳೆ ನೀರು ನೇರವಾಗಿ ನಮ್ಮ ಮನೆಗೆ ನುಗ್ಗುತ್ತದೆ .ಇದರಿಂದ ಸಾರ್ವಜನಿಕರಲ್ಲಿ ಆಕ್ರೋಶ ಮೂಡುತ್ತದೆ. ದಯವಿಟ್ಟು ದಯಾಳುಗಳಾದ ತಾವು ಇವರನ್ನು ಕರೆಸಿ ಸರಿಯಾದ ಯೋಜನೆ ಇಂದ ಅದನ್ನು ಮುಗಿಸುವಂತೆ ತಮ್ಮಲ್ಲಿ ವಿನಂತಿಸಿಕೊಳ್ಳುತ್ತಿದ್ದೇನೆ .','ದೂರು - Complaint','ಶಾಸಕರು ಈಗಾಗಲೇ ತಮಗೆ ಖುದ್ದಾಗಿ ಮಾತನಾಡಿದ್ದು, ಕಾಮಗಾರಿ ಸರಿಯಾದ ರೀತಿಯಲ್ಲಿ ಅನುಷ್ಟಾನಗೊಳಿಸಲು ಸಂಭಂದಿಸಿದವರಿಗೆ ಸೂಚಿಸಿದ್ದು, ಅನುಷ್ಟಾನದಲ್ಲಿ ಯಾವುದೇ ಲೋಪದೋಷಗಳಾದಲ್ಲಿ ತಾವು ಸಹ ಯಾವುದೇ ಸಮಯದಲ್ಲಿ ಶಾಸಕರ ಗಮನಕ್ಕೆ ತರಬಹುದಾಗಿದೆ. ','Drainage ','2019-05-13 09:18:02','2019-05-14 05:11:31',631),(105,15,8,463,'ಮಾನ್ಯ ಶಾಸಕರು ಭಟ್ಕಳ್ ವಿಧಾನಸಭಾ ಕ್ಷೆತ್ರ ಮಾನ್ಯರೆ ಮಂಕಿ ರಾಮನಗರದ ನಿವಾಸಿಯಾದ ಅಣ್ಣಪ್ಪ ನಾಯ್ಕ್ರ್ ಆದ ನಾನು ನಿಮ್ಮಲ್ಲಿ ಕೇಳಿಕೊಳ್ಳುವುದೇನೆಂದ್ರೆ (ರಾಮನಗರ ಬೂತ್ನ ಅಧ್ಯಕ್ಷ )ರಾಮನಗರಕ್ಕೆ ಕುಡಿಯುವ ನೀರಿನ ಸಮಸ್ಯೆ ಇದ್ದು ಗ್ರಾಮಪಂಚಾಯತ್ ನವರು ನೀಡುವ 05 ಕೊಡ ನೀರಿಗಾಗಿ ಕಾದು ಕುಳಿತುಕೊಳ್ಳುವ ಪರಿಸ್ಥಿತಿ ಎದುರಾಗಿ 2 ತಿಂಗಲುಗಳೇ ಕಳೆದಿದೆ .ನಿಮ್ಮಲ್ಲಿಯೂ ಸಾಕಷ್ಟು ಬಾರಿ ಚರ್ಚಿಸಿದ್ದೇವೆ .ಚುನಾವಣೆ ಸಂದರ್ಭದಲ್ಲಿ ನೀವು ಭರವಸೆ ನೀಡಿದ್ದೀರಿ ಭರವಸೆ ಇನ್ನು ಈಡೇರಿಲ್ಲ .ಇನ್ನಾದರೂ ಆ ಭರವಸೆ ಈಡೇರಬಹುದು ಎನ್ನುವ ನಂಬಿಕೆಯಲ್ಲಿ ಇದ್ದೇವೆ ತಾವು ಇದರ ಬಗ್ಗೆ ಗಮನಹರಿಸಬೇಕಾಗಿ ವಿನಂತಿ ','ದೂರು - Complaint','','Kudiyuva nirina bagge ','2019-05-15 03:32:18','2019-05-15 04:52:22',746),(115,30,8,297,'We require Govt Diploma in technical education having Mechanical, Electrcal, Electeonic communication, Automobile departments (AICTE approved) and Govt PU collage having science , commerce and arts stream in Bhatkal Taluk. I kindly request our honourable MLA to sanction the Govt.  Diploma in  technical collage in Bhatkal Taluk. And also kindly sanction the Govt PU Collage in Bhatkal taluk.','ಬೇಡಿಕೆ - Requirement','ಸರಕಾರಿ ಪಿಯು ಕಾಲೇಜು ಭಟ್ಕಳದಲ್ಲಿ ಕಳೆದ 10-12 ವರ್ಷಗಳಿಂದ ವಿದ್ಯಾದಾನ ಮಾಡುತ್ತಿದೆ . ಸರಕಾರಿ ಕಾನೂನು ಮಹಾವಿದ್ಯಾಲಯಕ್ಕೆ ಅನುಮೋದನೆ ಯನ್ನು ಪಡೆದಿದ್ದು ಮುಂದಿನ ವಷಗಳಲ್ಲಿ ಭಟ್ಕಳದಲ್ಲಿ ಪ್ರಾರಂಭಿಸಲಾಗುವುದು. ಡಿಪ್ಲಮೋ ಕಾಲೇಜನ್ನು ಪ್ರಾರಂಭಿಸಲು ಸರಕಾರದ ಗಮನಕ್ಕೆ ತಂದಿದ್ದು ಶೀಘ್ರದಲ್ಲಿ ಅನುಮೋದನೆಯನ್ನು ಪಡೆಯಲಾಗುವುದು.','Regarding technical collage and Govt PU collage','2019-05-15 14:27:00','2019-05-29 07:55:09',753),(116,16,NULL,32,'Sir please do the needful.  Please sanction concrete road for moodshirali bengre 2...near to Primary government school.  Because it is very difficult in rainy season to walk or transport.  Maximum 100 meter road.  Please consider the request sir ','ಬೇಡಿಕೆ - Requirement','ತಮ್ಮ ಬೇಡಿಕೆ ಸ್ಪಷ್ಟವಾಗಿಲ್ಲ. ದಯಮಾಡಿ ಕಚೇರಿಯನ್ನು ಸಂಪರ್ಕಿಸಿ ಮಾಹಿತಿಯನ್ನು ನೀಡಿ ','Concrete Road 100 meeter ','2019-05-17 13:32:50','2019-05-29 07:43:10',637),(117,30,NULL,295,'Alvekodi inda shirali ge.... ಶ್ರೀ ದುರ್ಗಾ ಪರಮೇಶ್ವರ ದೇವಸ್ಥಾನ ಕೆ shirali inda ಬರಬೇಕಾದರೆ madadyaalli tattihakala alli ರಸ್ತೆ ಹದ gettide.... hogabekadre tumba ತೊಂದರೆ ಆಗುತ್ತಿದೆ ರಸ್ತೆ ಆದಷ್ಟು ಬೇಗ ಸರಿ ಪಡಿಸ ಬೇಕಾಗಿ ವಿನಂತಿ pls ','ದೂರು - Complaint','ಮುಂದಿನ ದಿನಗಳಲ್ಲಿ ಆದ್ಯತೆಯ ಮೇರೆಗೆ ಪರಿಗಣಿಸಲಾಗುವುದು','ರಸ್ತೆ ದುರಸ್ತಿಗೆ ಆಗ್ರಹಿಸಿ ','2019-05-17 14:26:54','2019-05-27 15:11:26',326),(118,30,8,283,'ಮುರ್ಡೇಶ್ವರ ದಲ್ಲಿ ಚರಂಡಿ ಮತ್ತು ರಸ್ತೆ ಕಾಮಗಾರಿ ವಿಳಂಬ ಮಾಡುತ್ತಿದೆ ಆದಷ್ಟು ಬೇಗ ಮುಗಿಸಲು ನೀವು ಸಂಬಂಧ ಪಟ್ಟ ಅಧಿಕಾರಿಗ lige ಸೂಚನೆ ನೀಡಬೇಕು ದಯವಿಟ್ಟು ಸಾರ್ ದಿನ ಸಾವಿರಾರು ಪ್ರವಾಸಿಗರು ಬರುತ್ತಾರೆ ಅಲ್ಲಿನ ವ್ಯವಸ್ಥೆ ಸರಿ ಪಡಿಸಿ pls ','ದೂರು - Complaint','ಕಾಮಗಾರಿಯು ಪ್ರಗತಿಯಲ್ಲಿದ್ದು ಪ್ರತಿ ಎರಡು ದಿನಗಳಿಗೊಮ್ಮೆ ಚರಂಡಿಯ ನೀರನ್ನು ಬೇರೆಡೆಗೆ ವರ್ಗಾಯಿಸುವ ವ್ಯವಸ್ಥೆಯನ್ನು ಮಾಡಲಾಗಿದೆ.','ಮುರ್ಡೇಶ್ವರ ದೇವಸ್ಥಾನ ಕ್ಕೆ ದಿನ ಸಾವಿರಾರು ಪ್ರವಾಸಿಗರು ಬರುತ್ತಾರೆ ಅಲ್ಲಿ ನ ವ್ಯವಸ್ಥೆ ರಸ್ತೆ ಮತ್ತು ಚರಂಡಿ ಕಾಮಗಾರಿ ಪೂರ್ಣಗೊಳಿಸಲು ಕ್ರಮ ಕೈಗೊಳ್ಳಬೇಕು ದಯವಿಟ್ಟು ','2019-05-20 13:16:14','2019-05-29 07:53:19',326),(119,17,NULL,242,'ನಾನು ಜಾಲಿ ಪಟ್ಟಣ ಪಂಚಾಯತಿ ಗೆ ಒಳಪಟ್ಟ ನಿವಾಸಿ ಆಗಿದ್ದು ಇಲ್ಲಿನ ಪೊಸ್ಟ್ ಮ್ಯಾನ ಆದಂತಹ ಶಂಕರ್ ನಾಯ್ಕ ಇವರು ತಮ್ಮ ಕಾರ್ಯ ವನ್ನು ಸರಿಯಾಗಿ ನಿರ್ವಹಿಸುತ್ತಿಲ್ಲ.ಬಂದಂತಹ ಪೋಸ್ಟನ್ನು ತಾವೆ ಹೊಗಿ ಅದರಲ್ಲಿರುವ   address ಗೆ ತಲುಪಿಸದೆ ಅಫಿಸಿಗೆ ಬಂದಂತಹ ಜನರ ಹತ್ತಿರ ಈ ಪೊಸ್ಟನ್ನು ಇವರಿಗೆ ಕೊಡಿ ಎಂದು ಹೇಳುತ್ತಾರೆ. ಪೊಸ್ಟ ಬಂದು ಸುಮಾರು ದಿನಗಳಾಗಿ ಅದರಲ್ಲಿರುವ ಅವದಿ ಮುಗಿಯುವ ಸಮಯದಲ್ಲಿ ‌ತಲುಪಿಸುತ್ತಾರೆ. ಇಂತಹ ಜವಬ್ದಾರಿ ಇಲ್ಲದೆ ಕೆಲಸ ಮಾಡುವ ಪೊಸ್ಟ್ ಮ್ಯಾನ ಶಂಕರ್ ನಾಯ್ಕ ಇವರನ್ನು ತೆಗೆದು ಹಾಕಿ ಒಬ್ಬ ಜವಾಬ್ದಾರಿ ಇಂದ ಕೆಲಸ ಮಾಡುವ ಪೊಸ್ಟ್ ಮ್ಯಾನ್ ರನ್ನ ನಮ್ಮ ಪೊಸ್ಟ ಅಫಿಸಿಗೆ ನೀಡಿ. ಇದನ್ನು‌ ಕೆವಲ ನಾನೊಬ್ಬನೆ ಮಾಡುತ್ತಿರುವ ಆರೋಪ ಅಲ್ಲ ಇವರ ಬೇಜವಬ್ದಾರಿ ಕೆಲಸದಿಂದ ನೊಂದಂತಹ ಊರಿನ ಜನರ ಆರೋಪವಾಗಿದೆ. ನಿವು ಈ ಕ್ಷೇತ್ರದ ಶಾಸಕರು ನಿಮಗೆ ಈ ಕೆಲಸವನ್ನು ಬಹು ಬೇಗನೆ ಮಾಡುವ ಸಾಮರ್ಥ್ಯ ಇದೆ. ಆದಸ್ಟು ಬೇಗನೆ ಇದರ ಬಗ್ಗೆ ಕ್ರಮ ಕೈಗೊಳ್ಳಬೇಕಾಗಿ ತಮ್ಮಲ್ಲಿ ಕೆಳಿಕೊಳ್ಳುತ್ತೇನೆ.                                                                            ','ದೂರು - Complaint','','ಪೋಸ್ಟ್ ಮ್ಯಾನ್ ನನ್ನು ಬದಲಿಸುವ ಕುರಿತು','2019-05-27 12:14:31','2019-05-27 15:19:25',762),(120,15,8,163,'Dear sir\r\nBalemet to halonda road 2km ','ಬೇಡಿಕೆ - Requirement','','Road ','2019-05-28 08:47:54','2019-05-29 06:15:50',769),(121,15,8,1014,'Dear sir \r\nMagod to muragoli raod ','ಬೇಡಿಕೆ - Requirement','','Road ','2019-05-28 08:52:49','2019-05-29 06:15:31',769),(122,3,22,86,'Due to water crisis it\'s important to extend vacation  till 10th June in private and public schools.Take action please.\r\n','ಸಲಹೆ - Suggestion','3 ದಿನಗಳ ಹಿಂದೆಯೆ ಶಾಸಕರು ಈ ಬಗ್ಗೆ ಖುದ್ದು ಜಿಲ್ಲಾಧಿಕಾರಿಯವರೊಂದಿಗೆ ಚರ್ಚಿಸಿದ್ದು, ಶಾಲೆಗಳಲ್ಲಿ ಕುಡಿಯುವ ನೀರಿನ ಸಮಸ್ಯೆಗಳಿದ್ದು,  ಜೂನ 10 ರ ನಂತರ ಶಾಲೆಗಳನ್ನು ಪ್ರಾರಂಭಿಸಲು ಕೋರಿಕೊಂಡಿರುತ್ತಾರೆ. ಸೂಕ್ತ ಕ್ರಮ  ಜರುಗಿಸುವುದಾಗಿ ಜಿಲ್ಲಾಧಿಕಾರಿಗಳು ಭರವಸೆ ನೀಡಿರುತ್ತಾರೆ.','Extension of school vacation','2019-05-31 01:53:12','2019-05-31 14:04:07',772),(124,16,3,99,'ಮಳೆ ಬ