 ಸಮಯವನ್ನದರೂ ಬದಲಿಸಿ... ದಯವಿಟ್ಟು ಈ ಬಗ್ಗೆ ಸೂಕ್ತ ಕ್ರಮ ಕೈಗೊಳ್ಳಬೇಕಾಗಿ I ಮೂಲಕ ವಿನಂತಿಸುತ್ತೇನೆ...\r\nಧನ್ಯವಾದಗಳು.','ದೂರು - Complaint','ನೀರಿನ ಅಭಾವದಿಂದಾಗಿ ವಿದ್ಯುತ್‌ ಉತ್ಪಾದನೆಯಲ್ಲಿ ವ್ಯತ್ಯಯ ಉಂಟಾಗಿರುತ್ತದೆ.ಮಳೆಗಾಲದ ಪೂರ್ವತಯಾರಿಗಾಗಿ ಅಲ್ಲಲ್ಲಿ ಹೊಸ ಲೈನ್‌ ಮತ್ತು ಕಂಬಗಳ ಜೋಡನಾಕಾರ್ಯ ನಡೆಯುತ್ತಿರುವುದರಿಂದ ಪೂರೈಕೆಯಲ್ಲಿ ತೊಂದರೆಯಾಗುತ್ತಿದೆ. ಸಾರ್ಸೂವಜನಿಕರಿಗೆ ತೊಂದರೆಯಾಗದ ರೀತಿಯಲ್ಲಿ ದುರಸ್ಥಿ  ಕ್ರಮಗಳನ್ನು ಕೈಗೊಳ್ಳಲು ಇಲಾಖಾ ಅಧಿಕಾರಿಗಳಿಗೆ ತಿಳಿಸಲಾಗಿದೆ.','ರಾತ್ರಿ ವೇಳೆ ವಿದ್ಯುತ್ ವ್ಯತ್ಯಯ ಉಂಟಾಗುತ್ತಿರುವ ಕುರಿತು','2019-06-04 01:01:10','2019-06-10 10:41:46',363),(128,29,8,221,'It\'s been 18 years... Our road is not constructed even one time... It\'s been skipping from last few years... We hope our road will be constructed within couple of months...Also we are facing lot of issue with the water... Kindly please look into the water flow of the river in all Koppa panchayat village... There should be a proper dam for every 500/1 kms, so that there will be no issue for water in summer season.... ','ಬೇಡಿಕೆ - Requirement','ಕಾಮಗಾರಿಯ ಅವಶ್ಯಕತೆಯನ್ನು ಪರಿಗಣಿಸಿ ಕ್ರಿಯಾ ಯೋಜನೆಯಲ್ಲಿ ಸೇರಿಸಲಾಗಿದೆ.','Village development ','2019-06-04 03:05:48','2019-06-10 06:09:16',744),(129,3,NULL,86,'ಭಟ್ಕಳದಲ್ಲಿ emergency hospital ಮಾಡಬೇಕು ಅಂತ ನಿಮ್ಮಲ್ಲಿ ಕಳಕಳಿ ವಿನಂತಿ.','ಬೇಡಿಕೆ - Requirement','ಉತ್ತರಕನ್ನಡ ಜಿಲ್ಲೆಯಲ್ಲಿ ಮಲ್ಟಿಸ್ಪೆಷಲಿಟಿ ಆಸ್ಪತ್ರೆ ನಿರ್ಮಾಣದ ಬೇಡಿಕೆಯನ್ನು ಈಗಾಗಲೇ ಮಾನ್ಯ ಮುಖ್ಯಮಂತ್ರಿಯವರಿಗೆ ಹಾಗೂ ಸಂಭಂದಿಸಿದ ಸಚಿವರಿಗೆ ಸಲ್ಲಿಸಲಾಗಿದೆ. ಮುಂದಿನ ದಿನಗಳಲ್ಲಿ ಮಾನ್ಯ ಸಂಸದರಾದ ಅನಂತಕುಮಾರ ಹೆಗಡೆಯವರ ಸಹಾಯವನ್ನು ಪಡೆದು ರಾಜ್ಯ ಹಾಗೂ ಕೇಂದ್ರ ಸರ್ಕಾರದ ಮೇಲೆ ಒತ್ತಡ ತಂದು ಶೀಘ್ರ ಮಂಜೂರಾತಿಗೆ ಪ್ರಯತ್ನಿಸಲಾಗುವುದು.  ','Emergency hospital in bhatkal','2019-06-09 02:23:27','2019-06-10 10:46:17',788),(131,17,NULL,59,'ನಾನು ಕೊಟ್ಟ ಮೊದಲ ದೂರಿಗೆ ಪ್ರತಿಕಿಸಿದಕ್ಕೇ ಧನ್ಯವಾದ,\r\nಚರಂಡಿ ಸಮಸ್ಯೆ ಇವತ್ತಿನದಲ್ಲ . ನಮ್ಮ ಮನೆಯವರು ತುಂಬ ಸಮಸ್ಯೆಯನ್ನು ಗ್ರಾಮ ಪಂಚಾಯಿತಿಗೆ ತಿಳಿಸಿದರೆ ಆದರೇ ,ಗ್ರಾಮ ಪಂಚಾಯಿತಿ ಅವರು ಇಗೆ ಹೇಳಿದರು ಗ್ರಾಮ ಪಂಚಾಯಿತಿಯಲ್ಲಿ ದುಡ್ಡು ಇಲ್ಲಾ ಅಂತ .ಮತ್ತು ಕೆಲಸ ಮಾಡಲು ಜನರು ಸಿಗೋದಿಲ್ಲ ಅಂತ. 5 ಅಥವಾ 6 ವರ್ಷಗಳಿಂದ  ಸಮಸ್ಯೆ ತಿಳಿಸಿಧಿವೀ. ಅದರೆ ಏನೂ ಪ್ರಯೊಜನ ಇಲ್ಲಾ. ','ದೂರು - Complaint','ಗ್ರಾಮದ ಚರಂಡಿಗಳನ್ನು ಸ್ವಚ್ಛಗೊಳಿಸಿ ಮಳೆಗಾಲದಲ್ಲಿ ನೀರು ಸರಾಗವಾಗಿ ಹರಿದುಹೋಗುವಂತೆ ಕ್ರಮ ವಹಿಸುವುಂತೆ ಪಿ.ಡಿ.ಓ ಹೆಬಳೆ ಗ್ರಾಮ ಪಂಚಾಯತರವರಿಗೆ ಸೂಚಿಸಿ ತಮ್ಮ ದೂರನ್ನುಗ್ರಾಮ ಪಂಚಾಯತಕ್ಕೆ ವರ್ಗಾಯಿಸಲಾಗಿದೆ.','ಹೆರ್ತಾರ ಊರಿನ ದೇವುಮನೆ ಹತ್ತಿರದ ಚರಂಡಿ(ದುರಸ್ತಿ) ಕುರಿತು.','2019-06-09 16:06:01','2019-06-10 06:03:42',788),(132,17,NULL,350,'ಮಾನ್ಯ ಶಾಸಕರು\r\n                ನಮ್ಮೂರು ಮುಡ್ಕೇರಿ ಬಸ್ತಿ ಕಾಯ್ಕಿಣಿ \r\nವಿಷಯ: ಪ್ರತಿ ದಿನ ನಾವು ವಿದ್ಯುತ್ ಕಡಿತದ ಸಮಸ್ಯೆ ದಿಂದ ರೋಶಿ ಹೋಗಿದ್ದೇವೆ .ದಯಮಾಡಿ ತಾವು ನಮ್ಮನಮ್ಮೂರಿನ  ಉತ್ತರ ಕೊಪ್ಪ ಸಂಪರ್ಕದಿಂದ ಕಡಿತಗೊಳಿಸಿ ಬೇರೆ ಯಾವುದಾದರೂ ಸಂಪರ್ಕವನ್ನು ಮಾಡಿಕೊಡಬೇಕಾಗಿ ವಿನತಿ \r\n\r\nಇಂತಿ ನಿಮ್ಮ ಅಭಿಮಾನಿ \r\n ಮೋಹನ...\r\n       ಧನ್ಯವಾದ\r\n','ದೂರು - Complaint','','ವಿದ್ಯುತ್ ವಿಷಯದ ಕುರಿತು','2019-06-20 09:00:51','2019-06-21 11:46:38',83),(133,29,8,59,'  ಭಟ್ಕಳ್ ತಾಲೂಕಿನ ಹೆಬಳೆ ಗ್ರಾಮದ ಹೆರ್ತಾರ ಊರಿನಲ್ಲಿ ಸಮುದ್ರಕ್ಕೆ ಈ ಮೊದಲು ಇದ್ದ ಎಲ್ಲ ಪಿಂಚಿಂಗಳು ಸಮುದ್ರದ ನೀರಿನ ರಭಸಕ್ಕೆ ಎಲ್ಲ ಕಲ್ಲುಗಳು ಬಿದ್ದು ಹೋಗಿರುತ್ತದೆ.ಈಗ ಹೊಸ ಕಲ್ಲುಗಳನ್ನು ಹಾಕಿ ತಡೆಗೋಡೆ ಮಾಡುದು ತುಂಬ ಅಗತ್ಯವಿದೆ.ಇಲ್ಲದಿದ್ದರೆ ಈ ಭಾಗದಲ್ಲಿ ವಾಸಿಸುವ ಸುಮಾರು 150 ಮನೆಗಳ ನಿವಾಸಿಗಾಳಿಗೆ ತುಂಬಾ ಸಮಸ್ಯೆ ಉಂಟಾಗುತ್ತದೆ. ಆದ ಕಾರಣ  ತಾವುಗಳು ಈ ಕೂಡಲೇ ಪರಿಶೀಲಿಸಿ  ತಡೆಗೋಡೆ ನಿರ್ಮಾಣ ಅಗತ್ಯವಿದೆ. ಇಲ್ಲಾದಿದ್ದರೆ ಮಳೆಗಾಲದಲ್ಲಿ ತುಂಬ ಸಮಸ್ಯೆ  ಎದುರಿಸಬೇಕಾಗುತ್ತದೆ. ಇಲ್ಲಿ ಬಡವರು ಹೆಚ್ಚು ವಾಸಿಸುತ್ತಾರೆ , 500 ಮೀಟರ್ ಶಾಶ್ವತ ತಡೆಗೋಡೆ ನಿರ್ಮಾಣ ಮಾಡಬೇಕೆಂದು ಇ ಭಾಗದ ಜನರ ಕಳಕಳಿಯ ವಿನಂತಿ.','ದೂರು - Complaint','','ಹೆರ್ತಾರ ಊರಿನ ಸಮುದ್ರಕ್ಕೆ  ಶಾಶ್ವತ ತಡೆಗೋಡೆ ನಿರ್ಮಾಣ  ಕುರಿತು.','2019-06-21 09:54:37','2019-07-03 11:06:52',788),(134,17,8,202,'ಮಾನ್ಯರೇ,\r\n      ಸ್ವಚ್ಛ ಪರಿಸರ ನಮ್ಮೆಲ್ಲರ ಆದ್ಯ ಕರ್ತವ್ಯವಾಗಿದೆ. ಆದರೆ ಕೆಲವು ದಿನಗಳ ಹಿಂದೆ ಮಾಳ್ಕೊಡ್ ಗ್ರಾಮದ ಬೊಳಕಟ್ಟೆ ಸಮೀಪ ಕಸ ವಿಲೇವಾರಿ ಮಾಡಲಾಗಿದೆ... ಅಲ್ಲಿ ಹಾಕಲಾದ ಕಸದಲ್ಲಿ ಪ್ಲಾಸ್ಟಿಕ್ ಮತ್ತು ಕೆಮಿಕಲ್ ತ್ಯಾಜ್ಯಗಳು ಇವೆ...ಇಲ್ಲಿನ ಆಕಳುಗಳು ಅದನ್ನು ಸೇವಿಸಿ ಅನಾರೋಗ್ಯಕ್ಕೆ ತುತ್ತಾದ ಉದಾಹರಣೆಗಳೂ ಇವೆ ಆದ್ದರಿಂದ ಸಂಬಂಧಪಟ್ಟ ಅಧಿಕಾರಿಗಳ ಗಮನಕ್ಕೆ ತಂದು ಆ ಕಸವನ್ನು ವಿಲೇವಾರಿ ಮಾಡಿ ಮತ್ತೆ ಈ ರೀತಿ ಆಗದಿರುವಂತೆ ಕ್ರಮ ಕೈಗೊಳ್ಳಲು ಈ ಮೂಲಕ ಕೇಳಿಕೊಳ್ಳುತ್ತೇನೆ...\r\n\r\nಧನ್ಯವಾದಗಳು','ದೂರು - Complaint','','ಮಾಳಕೊಡ ಗ್ರಾಮದಲ್ಲಿ ಕಸ ವಿಲೇವಾರಿ ಮಾಡಿರುವ ಕುರಿತು','2019-06-25 08:17:30','2019-06-27 15:12:45',363),(135,15,8,99,'ಮಾನ್ಯರೇ ಭಟ್ಕಳ ವಿಧಾನ ವಿಧಾನಸಭಾ ಕ್ಷೇತ್ರದ ವ್ಯಾಪ್ತಿಯಲ್ಲಿ ಬರುವ ಮಂಕಿ ಗ್ರಾಮದ ಬಾಲಯ್ಯನವಾಡೆಯಲ್ಲಿನ ಸರ್ಕಾರಿ ಕಿರಿಯ ಪ್ರಾಥಮಿಕ  ಶಾಲೆಯ ಬಾವಿಯು ಕಳೆದ ಬೇಸಿಗೆಯಲ್ಲಿ ಸ್ವಲ್ಪ ಪ್ರಮಾಣದಲ್ಲಿ ಕುಸಿದಿದ್ದು ಇದೀಗ ತೀವ್ರ ಮಳೆಯಿಂದ ಇಡೀ ಬಾವಿ ಕುಸಿದಿದೆ ಹಾಗೂ ಹಾಗೂ ಆ ಬಾವಿಗೆ ತಾಗಿ  ಶಾಲಾ ಕಟ್ಟಡ  ಮತ್ತು ಶೌಚಾಲಯ ಇದ್ದು ಇವೆರಡು ಕುಸಿಯುವ ಸ್ಥಿತಿಯಲ್ಲಿದೆ .ಇಗ ಬಾವಿಯು ಅಮಾಯಕ ಜೀವಗಳ ಬಲಿಗಾಗಿ ಕಾಯುತ್ತಿದೆ ಆದ ಕಾರಣ ಪಾಲಕರು ಮಕ್ಕಳನ್ನು ಶಾಲೆಗೆ ಕಳುಹಿಸಲು ಒಪ್ಪುತ್ತಿಲ್ಲ  ಇದು ಮಕ್ಕಳ ಶಿಕ್ಷಣಕ್ಕೆ  ತೊಂದರೆಯಾಗಿದೆ..ಈ ಬಗ್ಗೆ ಕಳೆದ ಬೇಸಿಗೆಯಲ್ಲಿ ಶಾಲಾ ಮುಖ್ಯೋಪಾಧ್ಯಾಯರು ಮಂಕಿ  ಗ್ರಾಮ ಪಂಚಾಯಿತಿಗೆ ಹಾಗೂ ಕ್ಷೇತ್ರ ಶಿಕ್ಷಣಾಧಿಕರಿಗಳಿಗೆ  ದೂರು ನೀಡಿದ್ದರು ಯಾವುದೇ ಪರಿಣಾಮಕಾರಿ ಪ್ರತಿಕ್ರಿಯೆ ದೊರೆತಿಲ್ಲ. ','ದೂರು - Complaint',' ಬಾವಿಯು ಸಂಪೂರ್ಣ ಕುಸಿದಿದ್ದು ಇಂದು ಸ್ಥಳಕ್ಕೆ ಭೇಟಿ ನೀಡಿ ವಿದ್ಯಾರ್ಥಿಗಳ ಹಿತದೃಷ್ಟಿಯಿಂದ ಬಾವಿಯನ್ನು ಮುಚ್ಚಿಸಿ ಹೊಸ ಬಾವಿಯನ್ನು ಕೊರೆಯುವ ತೀರ್ಮಾನ ಕೈಗೊಳ್ಳಲಾಯಿತು.','ಶಾಲಾ ಬಾವಿ ಕುಸಿದು,ಶಾಲಾ ಕಟ್ಟಡ ಕೂಡ ಕುಸಿಯುವ ಸಾಧ್ಯತೆ ಇದೆ. ','2019-06-30 14:52:05','2019-07-04 10:20:15',802),(136,17,8,84,'ಅಳ್ವೇಕೋಡಿ ಬಂದರು ನಲ್ಲಿ ಮಾಡಲಾದ ಬೀದಿ ದೀಪ ಸರಿ ಪಡಿಸುವ ಕುರಿತು ಆದಷ್ಟು ಬೇಗ ','ದೂರು - Complaint','ದೂರವಾಣಿ ಮೂಲಕ ಸಂಭಂದಿಸಿದ ಅಧಿಕಾರಿಗೆ ತಿಳಿಸಲಾಗಿದೆ.','ವಿದ್ಯುತ್ ದೀಪ ಸರಿ ಪಡಿಸುವ ಕುರಿತು ','2019-07-17 13:43:03','2019-07-24 05:45:17',326),(137,17,8,215,'ಶಿರಾಲಿಯಿಂದ ಅಳ್ವೇಕೋಡಿ ರಸ್ತೆ ಯಲ್ಲಿ ಮಧ್ಯೆ ತಟ್ಟಿಹಕ್ಲಾ ರಸ್ತೆ ಯಲ್ಲಿ ಗಿಡ ಗಳು ರಸ್ತೆ ಮೇಲೆ ಬಂದಿದೆ ಬೈಕ್ ಹಾಗೂ ಬಸ್ ಹೋಗಲು ತೊಂದರೆ ಆಗಿ ರಸ್ತೆ ಮೇಲೆ ಬಂದಿದ್ದು ಮುಂದೆ ಬರವ ಸವಾರರು ಕಾಣುವುದಿಲ್ಲ. ಸವಾರರಿಗೆ ತೊಂದರೆ ಅನುಭವಿಸುವಂತಾಗಿದೆ ಆದಷ್ಟು ಬೇಗ ಅಲ್ಲಿ ಬೆಳೆದ ಗಿಡ ಗಳನ್ನೂ ಆದಷ್ಟು ಬೇಗ ಕಡಿಯಬೇಕು ದಯವಿಟ್ಟು ','ದೂರು - Complaint','ದೂರವಾಣಿ ಮೂಲಕ ಸಂಭಂದಿಸಿದ ಅಧಿಕಾರಿಗೆ ತಿಳಿಸಲಾಗಿದೆ.','ರಸ್ತೆಗೆ ಅಡ್ಡಲಾಗಿರುವ ಗಿಡ ಮರ ಕಡಿಯುವ ಕುರಿತು','2019-07-19 13:38:50','2019-07-24 05:43:29',326),(139,15,NULL,134,'Sir, we have applied for Residential NA for construction of house at our site. Although It\'s been months together we are not receiving proper response from officers.\r\n\r\nI request you to kindly solve this issue as soon as possible.\r\n\r\nContact :9008117935','ದೂರು - Complaint','','Residential NA','2019-07-25 03:20:11','2019-07-25 09:43:19',607),(140,15,NULL,86,'ಭಟ್ಕಳ ದಲ್ಲಿ ಮಾಡಲಾದ ಸಾಗರ್ ರಸ್ತೆ  ಹೊಸದಾಗಿ ಮಾಡಲಾದ ರಸ್ತೆ ಸರಿ ಪಡಿಸುವ ಕುರಿತು.. ಸಂಬಂಧ ಪಟ್ಟ ಅಧಿಕಾರಿಗಳಿಗೆ ಸೂಚನೆ ನೀಡಿ ಬೇಗ ಸರಿ ಪಡಿಸಬೇಕು. ಮತ್ತು ಅಲ್ಲಿರುವ ಬೀದಿ ದೀಪ ಸರಿ ಪಡಿಸಬೇಕು ','ದೂರು - Complaint','ಭಟ್ಕಳ ಪುರಸಭೆಯ ಮುಖ್ಯಾಧಿಕಾರಿಗಳಿಗೆ ಈಗಾಗಲೇ ಮಾಹಿತಿಯನ್ನು ನೀಡಲಾಗಿದೆ.ಕೆಲವೇ ದಿನಗಳಲ್ಲಿ ಸಮಸ್ಯೆಗೆ ಪರಿಹಾರ ಕಂಡುಕೊಳ್ಳಲಾಗುವುದು.','ಭಟ್ಕಳ circle inda ಆನಂದ ಆಶ್ರಮ ಶಾಲೆ ಸಾಗರ ರಸ್ತೆ ಮಾಡಲಾಗಿದ್ದು ಒಂದು ವರ್ಷ ದಲ್ಲಿ ಹಾಳಾಗಿದೆ ಆಡನ್ನು ಸರಿ ಪಡಿಸುವ ಕುರಿತು ','2019-07-25 09:23:26','2019-07-26 04:26:44',326),(141,15,NULL,283,'ಮುರ್ಡೇಶ್ವರ ದಲ್ಲಿ ಬಸ್ ನಿಲ್ದಾಣ ಹಳೆ dagi ನಿಲ್ಲಲು ಆಗ್ತಾ ಇಲ್ಲ ರಸ್ತೆ ಕೂಡ ಸರಿ ಇಲ್ಲ ಆದಷ್ಟು ಬೇಗ ರಸ್ತೆ ಮತ್ತು ಚರಂಡಿ ಹಾಗೂ ಬಸ್ ನಿಲ್ದಾಣ ವನ್ನು ಸರಿ ಪಡಿಸಿ ಬೇಕಾಗಿದೆ ಪ್ರವಾಸಿ ತಾಣ ವಾದ ಮುರ್ಡೇಶ್ವರ ದಲ್ಲಿ ಈ ರೀತಿ ಅವ್ಯವಸ್ಥೆ ಖಂಡಿಸಿ tteve ತಾವು ಆದಷ್ಟು ಬೇಗ ಎಲ್ಲ ವನ್ನು ಸರಿ ಪಡಿಸಬೇಕು ಎಂದು ಭಟ್ಕಳ ದ ಹಾಗೂ ಮುರ್ಡೇಶ್ವರ ಎಲ್ಲ ಜನತೆಯ ಪರವಾಗಿ ಕೇಳಿಕೊಳ್ಳುತ್ತಿದ್ದೇನೆ ','ದೂರು - Complaint','','ಮುರ್ಡೇಶ್ವರ ಬಸ್ ನಿಲ್ದಾಣ ದ ಕುರಿತು ಮತ್ತು ರಸ್ತೆ ಕಾಮಗಾರಿ ಸರಿ ಪಡಿಸುವ ಕುರಿತು ','2019-07-26 08:15:14','2019-07-26 08:33:03',326);
