INSERT INTO `notifications` VALUES (1,2,'Sample System Notification - this is the title','This is the content of the notification, the notification can handle any type and size of message, but we will initially limit it to 1024 characters. it is necessary to select \"Push\" if you need a push  message, otherwise it just shows up here in the header.\r\n\r\nThe expiry controls how long this message will be visible to all. This message is visible till tuesday',1,0,0,'2019-06-04','2019-06-03 09:35:05','2019-06-03 09:35:05'),(2,4,'ನೂತನವಾಗಿ ಆಯ್ಕೆಯಾದ ಕೇಂದ್ರ ಸಚಿವರ/ ಸಂಸದರ ಅಭಿನಂದನಾ ಕಾರ್ಯಕ್ರಮ','ಮಾನ್ಯರೇ,\r\nದಿನಾಂಕ: 05/06/2019 ಬುಧವಾರ  ದಂದು ಬೆಳಿಗ್ಗೆ 11.00 ಘಂಟೆಗೆ ತ್ರಿಪುರವಾಸಿನಿ, ಅರಮನೆ ಮೈದಾನ ಬೆಂಗಳೂರು ಇಲ್ಲಿ ನೂತನವಾಗಿ ಆಯ್ಕೆಯಾದ ಕೇಂದ್ರ ಸಚಿವರ ಮತ್ತು ಸಂಸದರ ಅಭಿನಂದನಾ ಕಾರ್ಯಕ್ರಮವನ್ನು ಆಯೋಜಿಸಿದ್ದು ಹೆಚ್ಚಿನ ಸಂಖ್ಯೆಯಲ್ಲಿ ಕಾರ್ಯಕರ್ತರು ಭಾಗವಹಿಸಬೇಕಾಗಿ ಕೋರಿದೆ.',1,0,0,'2019-06-05','2019-06-03 09:55:47','2019-06-04 05:42:58');
